[16049] = {name = "[q2]Diagrama: Bomba de Ferro Negro", additional_info = "Requer Engenharia (285)\n[q2]Uso: Ensina a fazer Bomba de Ferro Negro.\nBomba de Ferro Negro\nRequer Engenharia (285)\n[q2]Uso: Causa 225 to 675 de dano de Fogo e atordoa os alvos em um raio de 5 m por 4 sec. Qualquer dano interromperá o efeito. (1 Min Recarga)\nRequer Treco de Tório (2), Barra de Ferro Negro , Pó Explosivo Denso (3), Runatrama (3)"},
[16050] = {name = "Diagrama: Conversor Delicado de Arcanita", additional_info = "Requer Engenharia (285)\n[q2]Uso: Ensina a fazer Conversor Delicado de Arcanita.\nConversor Delicado de Arcanita\nRequer Barra de Arcanita , Seda de Aranha Ferroteia"},
