[16052] = {name = "[q2]Diagrama: Modulador de Amplificação de Voz", additional_info = "Requer Engenharia (290)\n[q2]Uso: Ensina a fazer Modulador de Amplificação de Voz.\n[q2]Modulador de Amplificação de Voz\nVincula-se quando equipado\nPescoço\n[q2]Equipar: Aumenta em 7% a sua resistência a efeitos de silêncio.\nRequer Conversor Delicado de Arcanita (2), Núcleo de Força de Ouro , Treco de Tório , Opala Grande"},
