[16054] = {name = "[q2]Diagrama: Dragonete de Arcanita", additional_info = "Requer Engenharia (300)\n[q2]Uso: Ensina a fazer Dragonete de Arcanita.\nSaqueado de: Magitramante de Cobalto\nChance de Saque: 2.28%\n[q3]Dragonete de Arcanita\nVincula-se quando equipado\nÚnico\nBerloque\nRequer Nível 50\nRequer Engenharia (300)\n[q2]Uso: Ativa seu Dragonete de Arcanita para lutar por você por 1 min. Requer uma hora de recarga antes de ser usado novamente. (1 Horas Recarga)\nRequer Dragonete Mecânico de Mithril , Conversor Delicado de Arcanita (8), Barra de Tório Encantado (10), Treco de Tório (6), Núcleo de Força de Ouro (4), Couro Encantado (6)"},
[16055] = {name = "[q2]Diagrama: Bomba Arcana", additional_info = "Requer Engenharia (300)\n[q2]Uso: Ensina a fazer Bomba Arcana.\nBomba Arcana\nRequer Engenharia (300)\n[q2]Uso: Drena 675 to 1125 pontos de mana de todos no raio de explosão e causa dano ao alvo equivalente a 50% do valor drenado. Também silencia todas as vítimas por 5 sec. (1 Min Recarga)\nRequer Conversor Delicado de Arcanita , Barra de Tório (3), Runatrama"},
