[23059] = {name = "[q0]Anel Couraçado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+27 Vigor\nClasses: Guerreiro\nRequer Nível 60\n[q2]Equipar: Aumenta em 1% a chance de esquivar-se de ataques.\n[q2]Equipar: Defesa aumentada em 10.\n\n[q]Equipamento de Batalha Couraçado (0/9)\n[q0]Braçadeiras Couraçadas\nPeitoral Couraçado\nManoplas Couraçadas\nCinta Couraçada\nCapacete Couraçado\nCoxotes Couraçados\nBrafoneiras Couraçadas\nEscarpes Couraçados\nAnel Couraçado\n[q0](2) Conjunto : Aumenta em 75 o dano causado pela sua habilidade Revanche.\n(4) Conjunto : Aumenta em 5% a sua chance de acerto com Provocar e Brado Desafiador.\n(6) Conjunto : Aumenta em 5% a chance de acerto das habilidades Fender Armadura, Golpe Heroico, Revanche e Escudada.\n(8) Conjunto : Por 5 segundos após ficar com menos de 20% dos pontos de vida, os feitiços de cura lançados em você curarão até mais 160 pontos de vida."},
[23060] = {name = "[q0]Anel Ceifa-ossos", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+20 Força\n+20 Agilidade\n+10 Vigor\nClasses: Ladino\nRequer Nível 60\n[q2]Equipar: Aumenta em 1% a chance de acerto.\n\n[q]Armadura Ceifa-ossos (0/9)\n[q0]Braçadeiras Ceifa-ossos\nPeitoral Ceifa-ossos\nManoplas Ceifa-ossos\nCapacete Ceifa-ossos\nCoxotes Ceifa-ossos\nBrafoneiras Ceifa-ossos\nEscarpes Ceifa-ossos\nCinta Ceifa-ossos\nAnel Ceifa-ossos\n[q0](2) Conjunto : Seus golpes corpo a corpo normais podem Envigorar você, curando 90 to 110 pontos de vida.\n(4) Conjunto : Os acertos críticos dos seus golpes Punhalada pelas Costas, Golpe Sinistro e Hemorragia recuperam 5 da sua energia. (500ms de recarga)\n(6) Conjunto : Reduz a ameaça gerada pelas suas habilidades Punhalada pelas Costas, Golpe Sinistro, Hemorragia e Eviscerar.\n(8) Conjunto : Seu golpe Eviscerar tem uma chance por ponto de combo de revelar uma fresta na armadura do seu oponente, concedendo 100% de chance de acerto crítico ao seu próximo Golpe Sinistro, Punhalada pelas Costas ou Hemorragia."},
[23061] = {name = "[q0]Anel da Fé", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+16 Intelecto\n+16 Espírito\nClasses: Sacerdote\nRequer Nível 60\n[q2]Equipar: Aumenta em até 55 a cura realizada por feitiços e efeitos mágicos.\n\n[q]Vestimenta da Fé (0/9)\n[q0]Cinto da Fé\nBraceletes da Fé\nDiadema da Fé\nLuvas da Fé\nPerneiras da Fé\nVeste da Fé\nSandálias da Fé\nOmbreiras da Fé\nAnel da Fé\n[q0](2) Conjunto : Reduz em 12% o custo de mana do seu feitiço Renovar.\n(4) Conjunto : Em acertos críticos de Cura Maior, seu alvo ganhará a Armadura da Fé, que absorverá até 500 de dano.\n(6) Conjunto : Reduz a ameaça dos seus feitiços de cura.\n(8) Conjunto : Cada feitiço que você lança pode ativar uma Epifania, aumentando em 24 sua regeneração de mana por 30 sec. (Chance de ativar:5%)"},
[23062] = {name = "[q0]Anel de Fogofrio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+10 Vigor\n+10 Intelecto\nClasses: Mago\nRequer Nível 60\n[q2]Equipar: Aumenta em até 30 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Aumenta em 1% a chance de realizar acertos críticos com feitiços.\n\n[q]Paramentos de Fogofrio (0/9)\n[q0]Cinto de Fogofrio\nBraceletes de Fogofrio\nDiadema de Fogofrio\nLuvas de Fogofrio\nPerneiras de Fogofrio\nVeste de Fogofrio\nSandálias de Fogofrio\nOmbreiras de Fogofrio\nAnel de Fogofrio\n[q0](2) Conjunto : Reduz em 1 min a recarga da sua Evocação.\n(4) Conjunto : Sua Armadura de Mago pode, ao ser atingida por um feitiço nocivo, aumentar em 35 a resistência contra a mesma escola de magia por 30 sec. (Chance de ativar:20%)\n(6) Conjunto : Seus feitiços nocivos podem fazer o seu alvo receber até 200 a mais de dano dos feitiços subsequentes. (Chance de ativar:20%)\n(8) Conjunto : Os seus feitiços de dano podem deslocar você, fazendo com que o seu próximo feitiço lançado não gere ameaça. (Chance de ativar:15%)\nSaqueado de: Kel'Thuzad\nChance de Saque: 20.88%"},
[23063] = {name = "[q0]Anel do Coração Pestilento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+24 Vigor\nClasses: Bruxo\nRequer Nível 60\n[q2]Equipar: Aumenta em até 29 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n\n[q]Traje Coração Pestilento (0/9)\n[q0]Cinto do Coração Pestilento\nBraceletes do Coração Pestilento\nDiadema do Coração Pestilento\nLuvas do Coração Pestilento\nPerneiras do Coração Pestilento\nVeste do Coração Pestilento\nSandálias do Coração Pestilento\nOmbreiras do Coração Pestilento\nAnel do Coração Pestilento\n[q0](2) Conjunto : Suas Setas Sombrias têm chance de curar 270 to 330 pontos de vida seus.\n(4) Conjunto : Aumenta em 12% o dano causado pelo seu feitiço Corrupção.\n(6) Conjunto : Os acertos críticos dos seus feitiços geram 25% a menos de ameaça. Além disso, seus feitiços Corrupção, Imolação, Maldição da Agonia e Sifão de Vida geram 25% a menos de ameaça.\n(8) Conjunto : Reduz em 12% o custo em pontos de vida da sua Conversão de Vida."},
[23064] = {name = "[q0]Anel Andassonho", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+16 Vigor\n+16 Intelecto\n+16 Espírito\nClasses: Druida\nRequer Nível 60\n[q2]Equipar: Aumenta em até 37 a cura realizada por feitiços e efeitos mágicos.\n\n[q]Traje Andassonho (0/9)\n[q0]Botas Andassonho\nCinturão Andassonho\nProtetores de Mão Andassonho\nBacinete Andassonho\nGuarda-pernas Andassonho\nEspaldares Andassonho\nTúnica Andassonho\nMunhequeiras Andassonho\nAnel Andassonho\n[q0](2) Conjunto : Cada cura periódica do seu Rejuvenescer pode restaurar 60 de mana, 8 de energia ou 2 de raiva do seu alvo.\n(4) Conjunto : Reduz em 3% o custo de mana dos seus feitiços Toque de Cura, Recrescimento, Rejuvenescer e Tranquilidade.\n(6) Conjunto : A cura instantânea e a cura periódica do seu Recrescimento aumentarão em até 50 o total de pontos de vida do alvo, acumulando até 7 vezes.\n(8) Conjunto : Quando o Toque de Cura acerta criticamente, você recupera 30% do custo de mana do feitiço."},
[23065] = {name = "[q0]Anel Quebraterra", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n+16 Vigor\n+16 Intelecto\nClasses: Xamã\nRequer Nível 60\n[q2]Equipar: Aumenta em até 37 a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Restaura 6 de mana a cada 5 s.\n\n[q]O Quebraterra (0/9)\n[q0]Botas Quebraterra\nCinturão Quebraterra\nProtetores de Mão Quebraterra\nBacinete Quebraterra\nGuarda-pernas Quebraterra\nEspaldares Quebraterra\nTúnica Quebraterra\nMunhequeiras Quebraterra\nAnel Quebraterra\n[q0](2) Conjunto : Reduz em 12% o custo de mana dos seus feitiços de totem.\n(4) Conjunto : Aumenta em 25% o mana obtido dos seus totens Fonte de Mana.\n(6) Conjunto : Seus feitiços Onda Curativa e Onda Curativa Menor podem imbuir o seu alvo em Poder Totêmico. (Chance de ativar:10%)\n(8) Conjunto : Seu feitiço Escudo de Raios também lhe concede 15 de mana a cada 5 s enquanto estiver ativo."},
