[202254] = {name = "[q3]Braçadeiras do Redirecionamento", additional_info = "Vincula-se quando equipado\nPulsos Couro\n44 Armadura\n+11 Vigor\n+13 Intelecto\n+8 Espírito\nDurabilidade 35 / 35\nRequer Nível 60\n[q2]Equipar: Aumenta em 1% a chance de realizar acertos críticos com feitiços."},
[202256] = {name = "[q2]Pistola Ornada do Corsário", additional_info = "Vincula-se ao ser recolhido\nLongo alcance Arma\n6 - 13 de dano Velocidade 1.90\n(5.00 de dano por segundo)\nDurabilidade 35 / 35Classes: Ladino\n[q2]Equipar: Ganha a habilidade Saque Rápido:\n\n\nSaca a arma de longo alcance e dispara um tiro rápido contra um inimigo, causando o dano normal da arma de longo alcance e reduzindo em 50% a velocidade de movimento do alvo por 6 sec. Concede 1 ponto de combo.\n\n Saque Rápido se beneficia de todos os talentos e efeitos que acionam ou modificam o Golpe Sinistro."},
[202641] = {name = "Caderno Coberto de Lama", additional_info = "Vincula-se ao ser recolhido\nEsse Item Começa uma MissãoClasses: Ladino\n[q]\"Este livro está coberto de lama, mas tem runas inscritas nas páginas e uma pequena anotação em um tipo de dialeto.\""},
[203723] = {name = "Bilhete do Picote", additional_info = "Vincula-se ao ser recolhido\nClasses: Ladino\n[q]\"Uma mensagem escrita no jargão dos ladrões.\"\n[q2]<Clique com o Botão Direito para Ler>"},
[203726] = {name = "[q2]Runa do Picote", additional_info = "Classes: Ladino"},
[203745] = {name = "[q2]Anotações de Feitiços: Lança de Gelo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRequerGravura\n(1)\n[q2]Grava nas luvas a runa de Lança de Gelo:\n\n\nCausa [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 55 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 65 / 100] de dano de Gelo a um alvo inimigo. Causa dano triplo contra alvos Congelados.\n[q]\"Ensina a você uma nova habilidade de Runogravura.\""},
[203746] = {name = "[q2]Anotações de Feitiços: Chama Viva", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRequerGravura\n(1)\n[q2]Grava na calça a runa de Chama Viva:\n\n\nEvoca uma chama de fogo místico que avança em direção ao alvo, deixando uma trilha de fogo místico. Essa trilha causa [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 100 / 100] de dano de Fogo Místico a cada segundo a inimigos próximos. Dura 10 sec.\n[q]\"Ensina a você uma nova habilidade de Runogravura.\""},
[203747] = {name = "[q2]Anotações de Feitiços: Dedos Glaciais", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRequerGravura\n(1)\n[q2]Grava na veste ou no peitoral a runa de Dedos Glaciais:\n\n\nConcede aos seus efeitos de Calafrio 15% de chance de conceder o efeito Dedos Glaciais a você, fazendo seus próximos 2 feitiços lançados tratarem o alvo como se ele estivesse congelado. Dura 15 sec.\n[q]\"Ensina a você uma nova habilidade de Runogravura.\""},
[203748] = {name = "[q2]Anotações de Feitiços: Combustão", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava no peitoral a runa de Combustão:\n\n\nAumenta em 15% sua chance de acerto crítico com todos os feitiços, mas seus acertos críticos com feitiços não periódicos agora têm um custo adicional de 1% do seu mana básico.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203749] = {name = "[q2]Anotações de Feitiços: Esclarecimento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava na veste ou no peitoral a runa de Esclarecimento:\n\n\nVocê causa 10% mais dano quando tem mais de 70% dos pontos de mana. Abaixo de 30% dos pontos de mana, 10% da sua regeneração de mana continua durante o lançamento.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203750] = {name = "Mapa do Tesouro de Elwynn", additional_info = "Vincula-se ao ser recolhido\nClasses: Ladino\n[q2]Uso: Escava tesouro no local marcado. (1 Min Recarga)\n[q]\"A oeste da Torre Serrana. Perto do toco, atrás do covil dos predadores.\""},
