[203990] = {name = "[q2]Runa da Mutilação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Mutilar:\n\n\nAtaca instantaneamente com as duas armas, causando 100% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo.\n\n Mutilar se beneficia de todos os talentos e efeitos que modificam ou são ativados por Punhalada pelas Costas, exceto em caso de especificação contrária.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203991] = {name = "[q2]Runa de Saque Rápido", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na veste ou no peitoral a runa de Saque Rápido:\n\n\nSaca a arma de longo alcance e dispara um tiro rápido contra um inimigo, causando o dano normal da arma de longo alcance e reduzindo em 50% a velocidade de movimento do alvo por 6 sec. Concede 1 ponto de combo.\n\n Saque Rápido se beneficia de todos os talentos e efeitos que acionam ou modificam o Golpe Sinistro.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203992] = {name = "[q2]Runa dos Ardis", additional_info = "Classes: Ladino\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203993] = {name = "[q2]Runa do Massacre", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava no cinto ou veste a runa de Atacar das Sombras:\n\n\nReduz em 20 o custo de Energia das suas habilidades Punhalada pelas Costas e Emboscar.\n\nGravar Luvas - Mutilar\nNão se aplica a Mutilar\n\n Não se aplica a habilidades aprendidas de outras runas.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[203994] = {name = "[q2]Runa da Mistura Mortífera", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na veste ou no peitoral a runa de Mistura Mortífera:\n\n\nConcede várias melhorias para os seus venenos:\n\n Quando você inocula outro veneno no alvo, você também inocula Veneno Mortal.\n\n Se sua arma não tiver um veneno aplicado, ela tem chance de ativar Veneno Instantâneo como se ele tivesse sido aplicado.\n\n Veneno Mortal e Veneno Instantâneo agora ganham mais dano do seu Poder de Ataque.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204174] = {name = "[q2]Runa da Precisão", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na calça a runa de No Meio da Testa:\n\n\nGolpe final de longo alcance que causa dano por ponto de combo, aumentado pelo Poder de Ataque, e atordoa o alvo:\n\n 1 ponto: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] a [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60))] de dano, atordoa por 1 s\n 2 pontos: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] a [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 2)] de dano, atordoa por 2 s\n 3 pontos: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] a [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 3)] de dano, atordoa por 3 s\n 4 pontos: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] a [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 4)] de dano, atordoa por 4 s\n 5 pontos: [53 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] a [81 / 100 * ((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) + (8.740728 - 0.415787 * 60 + 0.051973 * 60 * 60) * 5)] de dano, atordoa por 5 s.\n\n Recarga compartilhada com Golpe no Rim.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
