[204703] = {name = "[q2]Runa de Devastar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava nas luvas a runa de Devastar:\n\n\nQuando você está em Postura de Defesa e tem um escudo equipado, Fender Armadura também causa dano equivalente a 150% do dano da sua arma equipada por segundo, aumentado em 10% por aplicação de Fender Armadura já existente no alvo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204716] = {name = "[q2]Runa do Ataque Frenético", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava na calça a runa de Ataque Frenético:\n\n\nAo empunhar armas de 2 mãos, sua velocidade de ataque aumenta em 20%.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204795] = {name = "[q2]Runa do Golpe Sombrio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Golpe Sombrio:\n\n\nVocê se teleporta para trás de seu alvo e golpeia, causando ao alvo 150% do dano da arma. Precisa estar furtivo. Concede 1 ponto de combo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204804] = {name = "[q3]Braceletes Hidraxianos", additional_info = "Vincula-se ao ser recolhido\nPulsos Malha\n95 Armadura\n+4 Força\n+7 Vigor\nDurabilidade 40 / 40\nRequer Nível 25"},
[204806] = {name = "[q2]Runa do Ímpeto da Vitória", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava nas luvas a runa de Ímpeto da Vitória:\n\n\nAtaca instantaneamente o alvo, causando (1 + Attack power * 45 / 100) de dano e concedendo a você uma cura equivalente a 10% do seu máximo de pontos de vida. Só é possível usar em até 20 sec após matar um inimigo que conceda experiência ou honra.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204807] = {name = "[q3]Lâmina das Profundezas", additional_info = "Vincula-se ao ser recolhido\nDuas mãos Espada\n71 - 107 de dano Velocidade 3.60\n(24.72 de dano por segundo)\nDurabilidade 100 / 100\nRequer Nível 25\n[q2]Chance ao acertar: Atinge todos os inimigos à sua frente com água pressurizada.\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q]\"O som de ondas se quebrando ecoa a cada golpe.\""},
[204809] = {name = "[q2]Runa do Trovão Furioso", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava na calça a runa de Trovão Furioso:\n\n\nTrovoada agora aumenta o intervalo entre ataques em mais 6%, pode ser usada em qualquer postura, causa 100% a mais de dano e aumenta em 50% a ameaça.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[204864] = {name = "[q2]Notas do Aprendiz de Azora", additional_info = "Vincula-se ao ser recolhido\nÚnico (6)\n[q2]Uso: Combina 6 Anotações do Aprendiz de Azora para criar uma nova receita de gravura."},
