[204912] = {name = "[q2]Runa da Graça", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na calça a runa de Graça Demoníaca:\n\n\nIrrompe com energia vil, aumentando em 30% sua chance de esquiva e a do seu ajudante, e em 30% sua chance de acerto crítico em todos os ataques. Dura 6 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
