[205022] = {name = "[q2]Runa do Sifão da Alma", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na veste ou no peitoral a runa de Sifão da Alma:\n\n\nAumenta em 6% a quantidade de pontos drenada pelos seus feitiços Drenar Vida e Drenar Alma para cada efeito de Sombra afetando o alvo, até um máximo de 18% de efeito adicional.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205181] = {name = "Artefato Não Identificado", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Um tipo de material mágico esotérico. Um Bruxo mais experiente provavelmente pode explicar mais.\""},
[205182] = {name = "Artefato Sem Poderes", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Oferece seu próprio sangue para potencializar o artefato."},
