[205215] = {name = "[q2]Runa da Tática", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na veste ou no peitoral a runa de Táticas Demoníacas:\n\n\nAumenta em 10% a chance de acerto crítico com feitiços e corpo a corpo do seu ajudante.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205218] = {name = "[q2]Incunábulo da Descoberta", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\nRequer Nível 5\n[q2]Grava na veste ou no peitoral a runa de Sifão da Alma:\n\n\nAumenta em 6% a quantidade de pontos drenada pelos seus feitiços Drenar Vida e Drenar Alma para cada efeito de Sombra afetando o alvo, até um máximo de 18% de efeito adicional.\n[q]\"Alcança um estado de Inspiração ao matar 5 inimigos e depois aprende uma nova habilidade.\""},
[205228] = {name = "[q2]Runa da Seta do Caos", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava nas luvas a runa de Seta do Caos:\n\n\nAtira uma seta de fogo caótico contra o inimigo, causando [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 522 / 100] a [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 662 / 100] de dano de Fogo. A Seta do Caos sempre acerta, não pode ser resistida, e seu conhecimento faz todos os feitiços de Fogo penetrarem todos os efeitos de absorção. A Seta do Caos tem alta chance de ser resistida quando usada contra monstros que tenham quatro ou mais níveis acima do seu.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205230] = {name = "[q2]Runa da Assombração", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava nas luvas a runa de Assombrar:\n\n\nLibera uma alma fantasmagórica em um inimigo, causando [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 251 / 100] a [(6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60) * 295 / 100] de dano e aumentando em 20% todo o dano de Sombra causado no alvo ao longo do tempo. Quando Assombrar acaba ou é dissipado, você recebe uma cura equivalente ao dano que você causou no alvo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205364] = {name = "Mochila do Acólito", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]<Clique com o Botão Direito para Abrir>"},
[205420] = {name = "[q2]Incunábulo do Julgamento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\n[q2]Grava nas luvas a runa de Golpe do Cruzado:\n\n\nUm golpe instantâneo que causa dano Sagrado equivalente a 75% do dano da arma e regenera 5% do seu máximo de pontos de mana.\n[q]\"Aprenda uma nova habilidade após liberar 10 selos em inimigos.\""},
[205683] = {name = "[q2]Runa de Repreensão", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava na calça a runa de\n Repreensão:\n\n\nInterrompe o lançamento de feitiços e previne que qualquer feitiço da mesma escola seja lançado por 3 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205685] = {name = "[q2]Runa de Égide", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava no peitoral a runa de Égide:\n\n\nAumenta em 30% seu valor de bloqueio, e dano de ataques corpo a corpo e de longo alcance contra você têm 10% de chance de aumentar em 30% sua chance de bloquear. Dura 10 sec ou 5 bloqueios. Efeito não cumulativo com Reduto.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205863] = {name = "Incunábulo Corrompido", additional_info = "Classes: Paladino"},
[205864] = {name = "Bilhete Calcinado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]<Clique com o Botão Direito para Ler>"},
[205897] = {name = "[q2]Runa de Martírio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava no peitoral a runa de Selo do Martírio:\n\n\nPreenche você com espírito sagrado por 30 sec, fazendo cada um dos seus ataques corpo a corpo causar 50% do dano da arma ao seu alvo, mas você perde vida equivalente a 10% do dano causado. Enquanto o selo estiver ativo, integrantes do grupo ou raide em um raio de 40 m ganham pontos de mana equivalentes a 20% do dano que você recebe deste selo.\n\n Liberar a energia do Selo julga um inimigo, causando instantaneamente 85% do dano da arma a um custo de pontos de vida equivalentes a 10% do dano causado.\n\n O Selo e o Julgamento desta habilidade se beneficiam de talentos e efeitos que modificam o Selo ou o Julgamento do Selo da Retidão.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205905] = {name = "[q2]Memória de um Campeão Devoto", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na veste ou no peitoral a runa de Fé Corrompida:\n\n\nAçoite Mental e Impacto Mental causam 50% a mais de dano a alvos afetados pela sua Palavra Sombria: Dor.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205932] = {name = "[q2]Profecia do Óbito de um Rei", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava nas luvas a runa de Palavra Sombria: Morte:\n\n\nUma palavra de atamento sombrio que causa [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 320 / 100] a [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 372 / 100] de dano de Sombra ao alvo. Se o alvo não for morto por Palavra Sombria: Morte, o lançador receberá dano equivalente a 50% do dano causado ao alvo.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[205940] = {name = "[q2]Memória de um Propósito Sombrio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na veste ou no peitoral a runa de Peste do Caos:\n\n\nCausa uma doença no alvo que causa [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 129 / 100 * 6] de dano de Sombra ao longo de 18 sec.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205942] = {name = "Epifania Quimérica", additional_info = "[q2]Grava na calça a runa de Prece da Recomposição:\n\n\nLança um feitiço que concede ao alvo uma cura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] na próxima vez em que ele receber dano ou cura. Quando ocorre a cura, Prece da Recomposição propaga-se para um integrante do grupo ou raide em um raio de 20 m. Propaga-se até 5 vezes e dura 30 sec após cada propagação. Este feitiço só pode ser colocado em um único alvo por vez."},
[205943] = {name = "Profecia de uma Cidadela Profanada", additional_info = "Único\n[q2]Grava na calça a runa de Homúnculos:\n\n\nArranca lascas da própria alma para animar 3 cópias menores de si que tentam atacar seu alvo atual com maça, espada e machado, reduzindo, respectivamente, a velocidade de ataque, o poder de ataque e a armadura de qualquer alvo atingido.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[205944] = {name = "[q2]Epifania Recíproca", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na calça a runa de Prece da Recomposição:\n\n\nLança um feitiço que concede ao alvo uma cura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] na próxima vez em que ele receber dano ou cura. Quando ocorre a cura, Prece da Recomposição propaga-se para um integrante do grupo ou raide em um raio de 20 m. Propaga-se até 5 vezes e dura 30 sec após cada propagação. Este feitiço só pode ser colocado em um único alvo por vez.\n[q]\"Aprenda uma nova habilidade de Gravura.\""},
[205945] = {name = "[q2]Memória de um Salvador Aprisionado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na calça a runa de Dor Compartilhada:\n\n\nSua Palavra Sombria: Dor agora também afeta até 2 alvos próximos adicionais num raio de 15 m.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205946] = {name = "[q2]Memória da Traição de um Líder", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava nas botas a runa de Supressão de Dor:\n\n\nReduz instantaneamente em 40% todo o dano recebido por um alvo aliado e aumenta em 65% a resistência a mecânicas de Dissipar de um alvo aliado por 8 sec.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205947] = {name = "[q2]Profecia de uma Cidadela Profanada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na calça a runa de Homúnculos:\n\n\nArranca lascas da própria alma para animar 3 cópias menores de si que tentam atacar seu alvo atual com maça, espada e machado, reduzindo, respectivamente, a velocidade de ataque, o poder de ataque e a armadura de qualquer alvo atingido.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[205948] = {name = "Epifania Anódina", additional_info = nil},
[205949] = {name = "Epifania Múltipla", additional_info = "[q2]Grava nas luvas a runa de Círculo de Cura:\n\n\nCura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] pontos de vida de todos os integrantes do grupo em um raio de 40 m do jogador selecionado."},
[205950] = {name = "[q2]Epifania Tenebrosa", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava nas luvas a runa de Calcinação Mental:\n\n\nCausa uma explosão de magia sombria em torno do alvo inimigo, causando [70 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] a [78 / 100 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60)] de dano de Sombra a cada 1 s por 5 sec a todos os inimigos em um raio de 10 m em torno do alvo.\n[q]\"Aprenda uma nova habilidade de Gravura.\""},
[205951] = {name = "[q2]Memória de um Acólito Conturbado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava nas luvas a runa de Penitência:\n\n\nLança uma saraivada de luz sagrada contra o alvo, causando [(9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) * 128 / 100] de dano Sagrado a um inimigo ou curando [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 85 / 100] pontos de vida de um aliado instantaneamente e a cada 1 s por 2 sec.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205952] = {name = "Memória de um Mundo Despedaçado", additional_info = "[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[205953] = {name = "[q2]Profecia de um Voto Quebrado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava no cinto a runa de Aguilhão Mental:\n\n\nAtinge o alvo, causando de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] a [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] de dano de Sombra Gélida e aumentando em 30% a chance de acerto crítico do seu próximo Impacto Mental no alvo. Acumula até 3 vezes.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[205961] = {name = "Carne de Pássaro de Mulgore", additional_info = "Único\n[q2]Uso: Põe a isca perto de uma toca de felino."},
[205979] = {name = "[q2]Runa de Flanqueamento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na calça a runa de Ataque Flanqueante:\n\n\nVocê e sua mascote causam simultaneamente 100% de dano corpo a corpo. Depois disso, sua Mordida de Mangusto e seu Golpe do Raptor causam 10% a mais de dano por 10 sec, acumulando até 3 vezes. Golpe do Raptor tem 20% de chance de reiniciar a recarga de Ataque Flanqueante.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[205995] = {name = "Almíscar de Cão-da-pradaria", additional_info = "Classes: Caçador\n[q2]Uso: Sua habilidade Domar Fera também funciona em cães-da-pradaria (como mascotes). (10 Min Recarga)"},
[206032] = {name = "[q2]Runa de Trinchar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava nas luvas a runa de Trinchar:\n\n\nUm ataque de varredura que atinge todos os inimigos à sua frente, causando 65% do dano da arma.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206155] = {name = "[q2]Runa de Atirador de Precisão", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na veste ou no peitoral a runa de Mestre Atirador Perito:\n\n\nAumenta em 5% sua chance de acerto crítico e reduz em 25% o custo de Mana de todas as suas habilidades de Tiro.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206157] = {name = "Carga de Mineração de Cequatrum", additional_info = "Item de missão\nÚnico (5)"},
[206159] = {name = "Disfarce da Empreendimentos S.A.", additional_info = "Item de missão\n[q]\"Não parece muito um disfarce...\""},
[206168] = {name = "[q2]Runa da Quimera", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava nas luvas a runa de Tiro Quimérico:\n\n\nVocê causa 120% do dano da arma, renovando a Picada em seu alvo e ativando um efeito:\n\n Picada de Serpente – Causa instantaneamente 48% do dano causado pela Picada de Serpente.\n\n Picada de Víbora – Recupera instantaneamente o mana equivalente a 60% da quantidade total drenada pela sua Picada de Víbora.\n\n Picada de Escorpídeo – Tenta desarmar o alvo por 10 sec. Este efeito não pode ocorrer mais de uma vez a cada 1 minuto.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206169] = {name = "[q2]Runa de Tiro Explosivo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava nas luvas a runa de Tiro Explosivo:\n\n\nVocê dispara uma carga explosiva que se aloja em um inimigo, causando [Ranged attack power * 0.039 + 41 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)]-[Ranged attack power * 0.039 + 63 / 100 * (2.976264 + 0.641066 * 60 + 0.022519 * 60 * 60)] de dano de Fogo a todos os inimigos em um raio de 8 m. Além disso, a carga causará dano novamente, a cada segundo, por mais 2 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206170] = {name = "Cone de Fúria dos Ventos", additional_info = "Item de missão"},
[206175] = {name = "Unguento de Pinhão", additional_info = "Item de missão\nÚnico"},
[206176] = {name = "Almofariz e Pilão", additional_info = "Item de missão\nÚnico\n[q2]Uso: Tritura 8 Cones de Fúria dos Ventos para criar uma pomada venenosa para armas. Teoricamente."},
[206177] = {name = "Manteiga de Pinhão", additional_info = "Vincula-se ao ser recolhido\n[q2]Uso: Recupera 61.2 pontos de vida ao longo de 18 sec. É preciso ficar sentado enquanto come. Se você gastar pelo menos 10 segundos comendo, ficará bem alimentado e ganhará 2 de Vigor e Espírito por 15 min."},
[206264] = {name = "[q2]Runa de Inspiração", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava na calça a runa de Modelo de Inspiração:\n\n\nSua presença inspiradora dissipa periodicamente efeitos de Medo e Sono em integrantes do grupo próximos.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206344] = {name = "Jogo de Facas", additional_info = "Item de missão\nÚnico\n[q2]Uso: Tenta cortar um Peixinho Brilhante Cru em filetes."},
[206345] = {name = "Pedaços de Peixe", additional_info = "Item de missão\nÚnico"},
[206376] = {name = "[q2]Ícone do Baluarte", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava na veste ou no peitoral a runa de Proficiência em Escudo:\n\n\nCada vez que Bloquear, você regenera pontos de mana equivalentes a 8% do seu máximo de pontos de mana e ganha Armadura equivalente a 30% do valor de armadura do escudo, acumulando até 5 vezes. Você também ganha sempre 10% a mais de chance de Bloquear e 15% a mais no valor de Bloqueio.\n[q]\"Aprenda uma nova habilidade após acertar inimigos 25 vezes com Arma Trinca-pedra.\""},
[206381] = {name = "[q2]Ícone Diádico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava na veste ou no peitoral a runa de Sobrecarga:\n\n\nConcede aos feitiços Raio, Cadeia de Raios, Cura Encadeada, Onda Curativa e Estouro de Lava 50% de chance de serem lançados novamente no mesmo alvo. Esse segundo feitiço não tem custo, causa metade do dano ou cura e não gera ameaça.\n[q]\"Aprenda uma nova habilidade após receber dano de Natureza 10 vezes.\""},
[206382] = {name = "[q2]Ícone Tempestuoso", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 20\n[q2]Grava nas luvas a runa de Escudo de Água:\n\n\nO lançador é cercado por 3 globos de água que lhe concedem 1% do máximo de pontos de mana a cada 5 s. Quando um feitiço, ataque corpo a corpo ou de longo alcance atinge o lançador, 4% do máximo de pontos de mana do lançador são restaurados. Isso gasta um globo de água. Um globo é ativado em intervalos de segundos. Dura 10 min. Apenas um Escudo Elemental pode estar ativo no Xamã por vez.\n[q]\"Aprenda uma nova habilidade após acertar 10 PNJs com 3 elementos diferentes (Natureza, Fogo, Gelo).\""},
[206383] = {name = "[q2]Ícone Lítico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava nas calças a runa de Escudo da Terra:\n\n\nProtege o alvo aliado com um escudo terreno, reduzindo em 30% o tempo de lançamento ou de canalização de feitiços perdido quando sofre dano e curando [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] pontos de vida caso o aliado receba algum ataque. Este efeito só pode ocorrer uma vez a cada alguns segundos. O Escudo de Terra possui 9 cargas, dura 10 min e só pode ser colocado em um alvo de cada vez. Apenas um Escudo Elemental pode estar ativo em cada alvo.\n[q]\"Aprenda uma nova habilidade após bloquear 20 ataques com o escudo.\""},
[206384] = {name = "[q2]Ícone Astral", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q]\"Aprenda uma nova habilidade após acertar inimigos 25 vezes com Arma Trinca-pedra.\""},
[206385] = {name = "[q2]Ícone Clástico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava na calça a runa de Caminho Telúrico:\n\n\nCom a Arma Trinca-pedra ativa como arma da mão principal e um escudo equipado, a ameaça aumenta em 50%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque, mas tem o alcance reduzido à distância corpo a corpo.\n[q]\"Aprenda uma nova habilidade após derrotar 20 inimigos com Choque Terreno.\""},
[206386] = {name = "[q2]Ícone Galvânico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava na veste ou no peitoral a runa de Proficiência em Escudo:\n\n\nCada vez que Bloquear, você regenera pontos de mana equivalentes a 8% do seu máximo de pontos de mana e ganha Armadura equivalente a 30% do valor de armadura do escudo, acumulando até 5 vezes. Você também ganha sempre 10% a mais de chance de Bloquear e 15% a mais no valor de Bloqueio.\n[q]\"Aprenda uma nova habilidade após derrotar 10 inimigos com Raio.\""},
[206387] = {name = "[q2]Ícone Kajárico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\n[q2]Grava nas luvas a runa de Estouro de Lava:\n\n\nVocê lança lava derretida contra o alvo, causando [469 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] a [605 / 100 * (7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60)] de dano de Fogo. Se o alvo estiver sob o efeito de seu Choque Flamejante, o Estouro de Lava causará um acerto crítico.\n[q]\"Aprenda uma nova habilidade após receber dano de lava 5 vezes. (Reduz o dano de todas as fontes de lava)\""},
[206388] = {name = "[q2]Ícone Sulfúreo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava nas luvas a runa de Impacto Derretido:\n\n\nExplode até 4 inimigos em uma área cônica à sua frente, causando de [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 72 / 100 + 5 / 100 * Attack power] a [(7.583798 + 0.471881 * 60 + 0.036599 * 60 * 60) * 108 / 100 + 5 / 100 * Attack power] de dano de Fogo. Esta habilidade gera uma grande quantidade de ameaça. O dano periódico de Choque Flamejante tem 10% de chance de concluir a recarga de Impacto Derretido.\n[q]\"Aprenda uma nova habilidade após derrotar 10 inimigos com Choque Terreno.\""},
[206389] = {name = "[q2]Ícone de Enxofre", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava no cinto a runa de Nova de Fogo:\n\n\nO feitiço Totem de Nova de Fogo é substituído pela Nova de Fogo, o que faz o atual totem de Fogo emitir dano de onde estiver.\n[q]\"Aprenda uma nova habilidade após acertar inimigos 25 vezes com Arma Trinca-pedra.\""},
[206390] = {name = "[q2]Ícone Íctio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava nas luvas a runa de Escudo de Água:\n\n\nO lançador é cercado por 3 globos de água que lhe concedem 1% do máximo de pontos de mana a cada 5 s. Quando um feitiço, ataque corpo a corpo ou de longo alcance atinge o lançador, 4% do máximo de pontos de mana do lançador são restaurados. Isso gasta um globo de água. Um globo é ativado em intervalos de segundos. Dura 10 min. Apenas um Escudo Elemental pode estar ativo no Xamã por vez.\n[q]\"Aprenda uma nova habilidade após acertar inimigos 25 vezes com Arma Trinca-pedra.\""},
[206391] = {name = "[q2]Ícone Sizígico", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Totem\nClasses: Xamã\nRequer Nível 3\n[q2]Grava nas braçadeiras a runa de\n Contracorrente:\n\n\nCura [113 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] a [123 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] pontos de vida de um alvo aliado e mais [5 * 24 / 100 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60)] ao longo de 15 sec. Sua próxima Cura Encadeada lançada nesse alvo dentro de 15 sec consumirá o efeito de cura periódica e aumentará em 25% a quantidade de pontos de vida curados pela Cura Encadeada. Este feitiço também ativa Despertar Ancestral.\n[q]\"Aprenda uma nova habilidade após acertar inimigos 25 vezes com Arma Trinca-pedra.\""},
[206466] = {name = "Coroa da Pradaria", additional_info = "[q2]Uso: Desperta um espírito da planície."},
[206469] = {name = "Flor da Pradaria", additional_info = "Classes: Druida\n[q2]Uso: Combina 3 Flores da Pradaria para fazer uma coroa."},
[206954] = {name = "[q2]Ídolo de Raiva Ursina", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Ídolo\nClasses: Druida\nRequer Nível 10\n[q2]Grava nas luvas a runa de Destroçar:\n\n\nDestroça o alvo, causando 160% do dano normal, e faz o alvo receber 30% de dano adicional de efeitos de Sangramento e Despedaçar por 1 min. Esta habilidade se beneficia de todos os efeitos associados a Garra e Espancar e os ativa.\n[q]\"Aprenda uma nova habilidade após manter a raiva acima de 50 na Forma de Urso por 60 s.\""},
[206963] = {name = "[q2]Runa do Potencial Natural", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava na veste ou no peitoral a runa de Semente Viva:\n\n\nQuando realiza uma cura crítica com qualquer feitiço de cura não periódica, você planta no alvo uma Semente Viva que cura mais 50% do total curado. A Semente Viva floresce da próxima vez que o alvo receber dano ou cura não periódica. Dura 15 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206966] = {name = "Bulbo de Satirídea", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Muda de uma espécie vegetal invasora.\""},
[206970] = {name = "[q2]Runa da Vida", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava na calça a runa de Brotar da Vida:\n\nReduz em 0.5 s a recarga global das suas habilidades Rejuvenescer e Brotar da Vida, e você ganha a habilidade Brotar da Vida:\n\n\nCura [4 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida do alvo ao longo de 7 sec. Quando Brotar da Vida expira ou é dissipado, o alvo recebe instantaneamente uma cura de [57 / 100 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida, e o Druida recupera metade do custo do feitiço. Esse efeito pode acumular até 3 vezes no mesmo alvo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206975] = {name = "Chave do Depósito de Artefatos", additional_info = "Único\n[q]\"Abre o Baú do Depósito de Artefatos.\""},
[206985] = {name = "[q2]Eco do Alfa", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\nRequer Nível 3\n[q2]Grava nas botas a runa de Espírito do Alfa:\n\n\nImbui o alvo com o espírito de um lobo alfa, aumentando em 45% toda a ameaça gerada pelo alvo por 30 min. Limite de 1 alvo. Se o lançamento for em um alvo que não seja si mesmo, o Xamã também ganha Beta Leal, aumentando em 5% o dano Físico causado e reduzindo em 30% toda a ameaça gerada por 30 min. O mesmo alvo não pode ter Espírito do Alfa e Beta Leal ao mesmo tempo.\n[q]\"Aprenda uma nova habilidade.\""},
[206989] = {name = "[q2]Runa do Sol", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava nas luvas a runa de Fogo Solar:\n\n\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec.\n\n Além disso, na Forma de Urso, de Felino ou de Urso Hediondo, seu Fogo Lunar é substituído por Fogo Solar (Urso) ou Fogo Solar (Felino). Este feitiço se beneficia de todos os efeitos associados ao Fogo Lunar e os ativa.\n\n Fogo Solar (Urso)\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec.\n\n Fogo Solar (Felino)\nQueima o inimigo, causando [130 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] a [152 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza, depois mais [65 * 4 * (9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) / 100] de dano de Natureza ao longo de 12 sec. Concede 1 ponto de combo;.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[206992] = {name = "[q2]Runa de Esmagar Crânio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava na calça a runa de Esmagar Crânio:\n\n\nInveste contra um alvo em um raio de 13 m e esmaga seu crânio, interrompendo o lançamento de feitiços e impedindo que qualquer feitiço da mesma escola seja lançado por 2 sec. Compartilha a recarga com Investida Feral.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
