[208414] = {name = "[q2]Ídolo Lunar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Ídolo\nClasses: Druida\nRequer Nível 4\n[q2]Grava na veste ou no peitoral a runa de Fúria de Tempesfúria:\n\n\nReduz em 100% o custo de mana de Ira e a cada vez que você causa dano com Ira, você tem 12% de chance de fazer o próximo lançamento de Toque de Cura dentro de 15 sec ser instantâneo e poder ser lançado de qualquer forma metamorfoseada.\n[q]\"Derrote 6 criaturas afetadas por seu Fogo Lunar, depois use-o para aprender uma nova habilidade.\""},
