[208687] = {name = "[q2]Runa de Lacerar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava nas luvas a runa de\n Lacerar:\n\n\nLacera o alvo inimigo, fazendo-o [(9.183105 + 0.616405 * 60 + 0.028608 * 60 * 60) * 20 / 100 * 5] receber de dano ao longo de 15 sec, mais 20% do dano da arma por aplicação existente de Lacerar no alvo. Causa uma grande quantidade de ameaça. Este efeito acumula até 5 vezes no mesmo alvo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208689] = {name = "[q2]Ídolo Feroz", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Ídolo\nClasses: Druida\nRequer Nível 20\n[q2]Grava na calça a runa de Rugido Selvagem:\n\n\nGolpe de finalização que aumenta em 30% o dano físico causado na Forma de Felino. Dura mais a cada ponto de combo.\n 1 ponto: 14 segundos\n 2 pontos: 19 segundos\n 3 pontos: 24 segundos\n 4 pontos: 29 segundos\n 5 pontos: 34 segundos\n[q]\"Cause dano de sangramento a humanoides 20 vezes, depois use este ídolo para aprender uma nova habilidade.\""},
[208701] = {name = "[q2]Runa de Domínio das Feras", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava nas luvas a runa de Domínio das Feras:\n\n\nAumenta em 20% o dano e os pontos de vida do ajudante, e em 50% a regeneração de Concentração. Além disso, o Rosnar do ajudante agora também Provoca o alvo a atacá-lo por 3 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
