[208741] = {name = "[q2]Runa de Raiva Infinita", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava nas luvas a runa de Raiva Infinita:\n\n\nVocê gera 25% a mais de Raiva ao causar qualquer dano.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
