[208744] = {name = "[q2]Runa de Setas Sombrias", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava nas luvas a runa de Salva de Setas Sombrias:\n\n\nSeta Sombria agora atinge até 5 alvos dentro de uma distância de encadeamento de 10 m, mas com 20% a menos de dano.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208749] = {name = "Chave do Estoque de Masca-pinho", additional_info = "Único\n[q]\"Galho de árvore com um entalhe grosseiro no cabo.\""},
[208750] = {name = "[q2]Runa de Canalização", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na veste ou no peitoral a runa de Mestre Canalizador:\n\n\nDrenar Vida não é mais canalizado, dura 15 sec com recarga de 15 sec, custa 100% mais mana e cura 50% a mais cada vez que causa dano.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208753] = {name = "[q2]Anotações de Feitiços: Regeneração", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava na veste ou no peitoral a runa de Regeneração:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida do alvo ao longo de 3 sec e aplica um Foco Temporal por 30 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos.\n[q]\"Teaches you a new Engraving ability.\""},
[208754] = {name = "[q2]Anotações de Feitiços: REÇÃO ERNAGE", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Decifre as anotações de feitiços com um Patuá da Compreensão para aprender um novo feitiço de Gravura."},
[208758] = {name = "[q2]Runa Terrana", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava na calça a runa de Caminho Telúrico:\n\n\nCom a Arma Trinca-pedra ativa como arma da mão principal e um escudo equipado, a ameaça aumenta em 50%, os pontos de vida aumentam em 30%, o dano recebido é reduzido em 10%, a chance de receber acertos críticos de ataques corpo a corpo é reduzida em 6% e o Choque Terreno provoca os alvos a atacar você e tem uma recarga separada de outros feitiços de Choque, mas tem o alcance reduzido à distância corpo a corpo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208760] = {name = "Coroa da Clareira", additional_info = "[q2]Uso: Desperta um espírito da planície."},
[208764] = {name = "[q2]Runa da Mente", additional_info = "Único\nClasses: Sacerdote\n[q2]Grava no cinto a runa de Aguilhão Mental:\n\n\nAtinge o alvo, causando de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] a [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] de dano de Sombra Gélida e aumentando em 30% a chance de acerto crítico do seu próximo Impacto Mental no alvo. Acumula até 3 vezes."},
[208765] = {name = "[q2]Mão Amiga", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q]\"A mão se abrirá para um salvador.\""},
[208766] = {name = "[q2]Mão Amiga", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q]\"A mão se abriu para você.\"\n[q2]<Clique com o Botão Direito para Abrir>"},
[208767] = {name = "[q2]Runa de Recomposição", additional_info = "Único\nClasses: Sacerdote\n[q2]Grava na calça a runa de Prece da Recomposição:\n\n\nLança um feitiço que concede ao alvo uma cura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 74 / 100] na próxima vez em que ele receber dano ou cura. Quando ocorre a cura, Prece da Recomposição propaga-se para um integrante do grupo ou raide em um raio de 20 m. Propaga-se até 5 vezes e dura 30 sec após cada propagação. Este feitiço só pode ser colocado em um único alvo por vez.\n[q]\"Ensina a você uma nova habilidade de Runogravura.\""},
[208768] = {name = "Caixa de Fósforos dos Bucaneiros", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q]\"Usada para incendiar materiais inflamáveis.\""},
[208771] = {name = "[q2]Runa de Dança de Lâminas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na calça a runa de Dança de Lâminas:\n\n\nGolpe de finalização que aumenta em 10% sua chance de aparar. Dura mais a cada ponto de combo.\n\n 1 ponto: 14 segundos\n 2 pontos: 18 segundos\n 3 pontos: 22 segundos\n 4 pontos: 26 segundos\n 5 pontos: 30 segundos\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208772] = {name = "[q2]Runa de Talho de Sabre", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Talho de Sabre:\n\n\nTalha um inimigo de forma cruel, causando 100% do dano da arma e fazendo o alvo sangrar e receber (Attack power * 5 / 100) de dano a cada 2 s por 12 sec, acumulando até 3 vezes. Concede 1 ponto de combo.\n\n O Talho de Sabre se beneficia de todos os talentos e efeitos que se ativem com o Golpe Sinistro ou o modifiquem.\n[q]\"Ensina a você uma nova habilidade de Gravura.\"\nSaqueado de: Batedor Défias\nChance de Saque: 4.76%"},
[208773] = {name = "Arpão de Pesca", additional_info = "Vincula-se ao ser recolhido\nClasses: Guerreiro , Caçador\n[q2]Uso: Arremessa o arpão no alvo (40 m de alcance).\n[q]\"Item obrigatório para o aspirante a caçador de tubarão!\""},
[208777] = {name = "[q2]Runa do Franco-atirador", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na calça a runa de Treinamento de Franco-atirador:\n\n\nSuas habilidades de Tiro ganham 2% a mais de chance de acerto crítico quando você passa 2 s sem se mover, acumulando a cada segundo até 5 vezes. Ao se mover, você perderá 1 aplicação por segundo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208778] = {name = "[q2]Runa de Golpe Rápido", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava nas luvas a runa de Golpe Rápido:\n\n\nUm golpe corpo a corpo instantâneo inclemente com a arma de duas mãos, causando (Attack power * 10 / 100) a (Attack power * 20 / 100) de dano Físico. Esta habilidade se beneficia de todos os efeitos associados a Golpe Heroico e os ativa.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208799] = {name = "[q2]Anotações de Feitiços: Bomba Viva", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava nas luvas a runa de Bomba Viva:\n\n\nO alvo se torna uma Bomba Viva, recebendo [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 85 / 100 * 4] de dano de Fogo ao longo de 12 sec. Depois de 12 sec ou quando o feitiço for dissipado, o alvo explode, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 171 / 100] de dano de Fogo a todos os inimigos em um raio de 10 m.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[208800] = {name = "Baxtan: Sobre Magias Destrutivas", additional_info = "Único\n[q]\"As inscrições de um notável mago goblin. Uma bela adição a qualquer biblioteca.\""},
[208823] = {name = "Moeda de Oferenda", additional_info = "Vincula-se ao ser recolhido\nClasses: Sacerdote\n[q2]Uso: Jogue em um poço próximo para fazer um desejo."},
[208828] = {name = "Memória de um Voto Quebrado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava no cinto a runa de Aguilhão Mental:\n\n\nAtinge o alvo, causando de [122 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] a [142 * (9.456667 + 0.635108 * 60 + 0.039063 * 60 * 60) / 100] de dano de Sombra Gélida e aumentando em 30% a chance de acerto crítico do seu próximo Impacto Mental no alvo. Acumula até 3 vezes.\n[q2]Uso: Foca na Memória para aprender um novo feitiço. Requer uma mente purificada pela meditação acerca dos mistérios espirituais de Azeroth."},
[208833] = {name = "Torta Malevolente", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q]\"Uma massa com uma energia sinistra.\""},
[208838] = {name = "[q2]Cofre de Ferro Negro", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q0]Trancado\n Requer Abrir fechadura (1)"},
