[208847] = {name = "Geodo de Caveira", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q]\"Provavelmente pode ser rachado com uma batida firme.\""},
[208848] = {name = "Geodo de Caveira Rachado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q]\"O geodo foi aberto.\"\n[q2]<Clique com o Botão Direito para Abrir>"},
[208849] = {name = "[q2]Incunábulo das Bênçãos", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\nRequer Nível 4\n[q2]Grava no peitoral a runa de Trompa de Lordaeron:\n\n\nO Paladino sopra a Trompa de Lordaeron, que aumenta a Força e a Agilidade total de todos os integrantes do grupo em um raio de 30 m em 6. Dura 2 min. Exclusiva com Bênção do Poder.\n[q]\"Aprenda uma nova habilidade após abençoar 5 jogadores diferentes.\""},
[208851] = {name = "[q2]Incunábulo de Justiça", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\nRequer Nível 8\n[q2]Grava nas luvas a runa de Mão da Desforra:\n\n\nProvoca o alvo a atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Enquanto você souber esta habilidade, o bônus de ameaça de Fúria Íntegra é aumentado em 80% e faz você ganhar mana equivalente a 25% do total curado. Além disso, enquanto a Fúria Íntegra está ativa, dano que deixe você com menos de 35% dos pontos de vida é reduzido em 20%. Fúria Íntegra permanece ativa até ser cancelada.\n[q]\"Aprenda uma nova habilidade após matar 10 inimigos atordoados pelo Martelo da Justiça.\""},
[208853] = {name = "[q2]Anotações de feitiços: Congelamento Cerebral", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\nRequerGravura\n(1)\n[q2]Grava nas botas a runa de Congelamento Cerebral:\n\n\nSeus feitiços de dano de Gelo que causam efeitos enregelantes têm 15% de chance de que o lançamento do seu próximo feitiço Bola de Fogo, Seta de Gelo Mágico ou Seta de Fogofrio seja instantâneo e não custe mana.\n[q]\"Ensina a você uma nova habilidade de Runogravura.\""},
[208854] = {name = "[q2]Anotações de Feitiços Mastigadas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Decifre as anotações de feitiços com um Patuá da Compreensão para aprender um novo feitiço de Gravura.\n[q]\"Xamãs troggs são realmente leitores vorazes.\""},
