[209852] = {name = "[q2]Runa de Comando para Matar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na calça a runa de Comando para Matar:\n\n\nDá o comando para matar, aumentando em 60% o dano causado por Arranhar e Morder por 30 sec. Cada Arranhar e Morder realizado pelo ajudante reduz em 20% o bônus de dano.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
