[210137] = {name = "[q2]Runa do Crescimento Silvestre", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava nas luvas a runa de Crescimento Silvestre:\n\n\nCura [34 / 100 * 7 * (38.949830 + 0.606705 * 60 + 0.167780 * 60 * 60)] pontos de vida de todos os integrantes do grupo do jogador selecionado em um raio de 40 m do alvo ao longo de 7 sec. A quantidade curada é aplicada rapidamente no início e fica mais lenta conforme o Crescimento Silvestre chega ao fim da duração.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
