[210229] = {name = "[q2]Runa da Mutilação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Mutilar:\n\n\nAtaca instantaneamente com as duas armas, causando 100% do dano da arma mais [100 / 100 * (5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60)] com cada arma. O dano é aumentado em 20% contra alvos Envenenados. Concede 2 pontos de combo.\n\n Mutilar se beneficia de todos os talentos e efeitos que modificam ou são ativados por Punhalada pelas Costas, exceto em caso de especificação contrária.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210250] = {name = "Anel de Ouro Gravado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n[q]\"A gravação diz: enquanto ambos __ __ se ajoelham __ no cemitério __.\""},
[210251] = {name = "Anel de Prata Gravado", additional_info = "Vincula-se ao ser recolhido\nÚnico\nDedo\n[q]\"A gravação diz: __ usar __ anéis __ perante __ estátua __ o __\""},
[210252] = {name = "[q2]Runa da Estocada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Estoque:\n\n\nAtaca instantaneamente com a arma de mão secundária para causar o dano normal da arma secundária com 100% de chance de aplicar o veneno da arma secundária no alvo. Armas mais lentas requerem mais energia. Concede 1 ponto de combo.\n\n A Estocada se beneficia de todos os talentos e efeitos que se ativem com o Golpe Sinistro ou o modifiquem.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210253] = {name = "[q2]Totem de Podridão", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Chamado aos espíritos dos elementos.\n[q]\"Um totem tradicional... distorcido e pervertido por magias sombrias, quase irreconhecível para aqueles que comungam com os elementos.\""},
[210322] = {name = "[q2]Runa de Peçonha", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na calça a runa de Envenenar:\n\n\nGolpe final que causa dano de Veneno instantâneo com base nas doses de seu Veneno Mortal no alvo. Após o ataque com Envenenar, você aplica, com frequência 75% maior, Veneno Instantâneo por 1 s, mais 1 s adicional por ponto de combo. Uma dose é ativada por ponto de combo:\n 1 dose: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 1 + Attack power * 0.09] de dano\n 2 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 2 + Attack power * 0.18] de dano\n 3 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 3 + Attack power * 0.27] de dano\n 4 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 4 + Attack power * 0.36] de dano\n 5 doses: [((5.741530 - 0.255683 * 60 + 0.032656 * 60 * 60) * 100 / 100) * 5 + Attack power * 0.45] de dano\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210323] = {name = "Combinação do Cofre", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q]\"0-4-5-1\""},
[210329] = {name = "Mapa do Tesouro de Eira dos Montes", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q]\"Siga o rio ao norte, além das Montanhas de Alterac. O que você busca está sob as corredeiras.\""},
[210330] = {name = "Dica Quente", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Informação de qualidade não é barata.\"\n[q2]<Clique com o Botão Direito para Abrir>"},
[210410] = {name = "Isca de Tartalisca de Água Doce", additional_info = "Classes: Caçador\n[q2]Uso: Joga a isca. (5 Min Recarga)\n[q]\"Jogue umas na água para atrair uma das grandes.\""},
[210499] = {name = "Charcomelo", additional_info = "[q2]Uso: Come (por sua conta e risco)."},
[210500] = {name = "[q2]Runa das Estrelas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava na calça a runa de Surto Estelar:\n\n\nDispara um surto de energias estelares que causa [248 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] a [304 / 100 * (9.183105 + 0.616405 * 1 + 0.028608 * 1 * 1)] de dano Arcano e aumenta em 80% o dano causado por Â 1 lançamento de Fogo Estelar por 15 sec.\n\n Surto Estelar ativa e se beneficia da maioria dos talentos e efeitos que ativam ou se beneficiam de Ira ou Fogo Estelar.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210534] = {name = "[q2]Ídolo do Selvagem", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Ídolo\nClasses: Druida\n[q2]Grava na veste ou no peitoral a runa de Golpe Selvagem:\n\n\nEnquanto você estiver em Forma de Felino, Forma de Urso ou Forma de Urso Hediondo, integrantes do grupo em um raio de 20 m obtêm mais ferocidade de combate. Cada ataque corpo a corpo tem 20% de chance de conceder outro ataque com 20% a mais de Poder de Ataque. Sem efeito se o integrante do grupo já se beneficiar do Totem de Fúria dos Ventos.\n[q]\"Cure 10 feras, depois use o ídolo para aprender uma nova habilidade.\""},
[210568] = {name = "Filactério Decrépito", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Uma aura repulsiva emana do artefato.\""},
[210569] = {name = "[q2]Runa de Flagelação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava no peitoral a runa de Flagelação:\n\n\nConcede um bônus de 25% ao dano Físico causado por 12 sec após ativar Fúria Sanguinária ou Raiva Incontrolada.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210573] = {name = "[q2]Runa de Raiva Debilitante", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava na calça a runa de Consumido pela Raiva:\n\n\nEnfurece você e concede um bônus de 10% de dano corpo a corpo por 12 sec ou até um máximo de 12 golpes depois de exceder 80 de Raiva.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210589] = {name = "[q2]Eco dos Antepassados", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\nRequer Nível 3\n[q2]Grava na calça a runa de Conselho dos Ancestrais:\n\n\nPelos próximos 10 sec, 25% do seu dano serão convertidos em cura de até 3 integrantes do grupo próximos, e 100% da cura serão convertidos em dano no último alvo de Choque Flamejante.\n[q]\"Aprenda uma nova habilidade de Gravura.\""},
[210596] = {name = "[q2]Runa de Golpes de Naja", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na veste ou no peitoral a runa de Golpes de Naja:\n\n\nSeus acertos críticos com habilidades de Tiro fazem os 2 próximos ataques especiais do seu ajudante acertarem criticamente.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210653] = {name = "[q2]Runa de Adaga de Bloqueio", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava nas luvas a runa de Adaga de Bloqueio:\n\n\nGolpeia instantaneamente com a arma de mão secundária, causando o dano normal da arma de mão secundária e aumentando em 10% sua chance de aparo por 10 sec. Concede 3 pontos de combo.\n\n A Adaga de Bloqueio se beneficia de todos os talentos e efeitos que se ativem com o Golpe Sinistro ou o modifiquem.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210654] = {name = "[q2]Anotações de Feitiços: Retroceder Tempo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava nas luvas a runa de Retroceder Tempo:\n\n\nSeu alvo atual com um Foco Temporal recupera instantaneamente todo o dano sofrido nos últimos 5 s. Não funciona em alvos que não tinham um Foco Temporal 5 s atrás.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210655] = {name = "[q2]Anotações de Feitiços: DEPOMECTRE RETRO", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Decifre as anotações de feitiços com um Patuá da Compreensão para aprender um novo feitiço de Gravura."},
