[210696] = {name = "[q2]Ruína dos Pútridos", additional_info = "Vincula-se ao ser recolhido\nMão principal Espada\n18 - 34 de dano Velocidade 2.60\n(10.00 de dano por segundo)\nDurabilidade 60 / 60Classes: Guerreiro\nRequer Nível 14\n[q]\"Recoberta de sangue, a lâmina não brilha mais sob a luz. A bem da verdade, isso serve de aviso...\""},
[210708] = {name = "Elixir do Arrependimento Coalescido", additional_info = "Requer Nível 20\n[q2]Uso: Quem consome pode falar com o cadáver de alguém que tenha assuntos não resolvidos no mundo mortal. Também cura indigestão. (3 Seg Recarga)"},
[210709] = {name = "[q2]Receita: Elixir do Arrependimento Coalescido", additional_info = "Requer Alquimia (90)\n[q2]Uso: Ensina a fazer Elixir do Arrependimento Coalescido.\nElixir do Arrependimento Coalescido\nRequer Nível 20\n[q2]Uso: Quem consome pode falar com o cadáver de alguém que tenha assuntos não resolvidos no mundo mortal. Também cura indigestão. (3 Seg Recarga)\nRequer Estrangulalga (5), Ampola Chumbada , Musgo de Tumba (5), Pó d'Alma"},
[210712] = {name = "Elixir da Percepção", additional_info = "Vincula-se ao ser recolhido\n[q2]Uso: Contempla uma visão da fogueira de Je'neu."},
[210713] = {name = "Alma Torturada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Uso: Faz uma Oferenda de Sangue para libertar esta Alma Torturada."},
