[210741] = {name = "[q3]Espanca-gente Automático", additional_info = "Vincula-se ao ser recolhido\nDuas mãos Maça\n53 - 85 de dano Velocidade 2.00\n(34.50 de dano por segundo)\n+22 Força\n+8 Agilidade\nDurabilidade 100 / 100Classes: Paladino , Xamã , Druida\nRequer Nível 40\n[q2]Equipar: +69 de Poder de Ataque sob forma de Felino, Urso e Urso Hediondo.\n[q2]Uso: Aumenta em 50% a sua velocidade de ataque por 30 sec. (3 Min Recarga)\n[q]\"Várias melhorias foram feitas para aprimorar a usabilidade do modelo deste ano.\""},
[210746] = {name = "[q2]Runa de Escudo da Terra", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava nas calças a runa de Escudo da Terra:\n\n\nProtege o alvo aliado com um escudo terreno, reduzindo em 30% o tempo de lançamento ou de canalização de feitiços perdido quando sofre dano e curando [55 * (29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) / 100] pontos de vida caso o aliado receba algum ataque. Este efeito só pode ocorrer uma vez a cada alguns segundos. O Escudo de Terra possui 9 cargas, dura 10 min e só pode ser colocado em um alvo de cada vez. Apenas um Escudo Elemental pode estar ativo em cada alvo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210763] = {name = "Ramo de Altek", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Um fragmento de poder. Parece se tratar da metade de uma arma grandiosa.\""},
[210765] = {name = "Orbe de Des", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Chamas e magia sombria revolvem no orbe, de forma hipnotizante e profundamente preocupante. Parece se tratar da metade de uma arma grandiosa.\""},
[210771] = {name = "[q2]Suprimentos Escondidos: Barras de Cobre", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Waylaid Shipment] (12)\n[q2]Uso: Adicione 20 Barras de Cobre para completar o carregamento."},
[210772] = {name = "[q2]Carga de Suprimentos: Barras de Cobre", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Supply Shipment] (1)\n[q]\"Entregue para um oficial de suprimentos para receber uma vultosa recompensa.\""},
[210773] = {name = "[q3]Dragonas da Segunda Guerra", additional_info = "Vincula-se quando equipado\nOmbros Malha\n163 Armadura\n+8 Vigor\nDurabilidade 70 / 70\nRequer Nível 25\n[q2]Equipar: Aumenta em até 11 o dano causado por feitiços e efeitos Sagrados."},
[210779] = {name = "[q2]Instruções: Dragonas da Segunda Guerra", additional_info = "Vincula-se ao ser recolhido\nRequer Ferraria (150)\n[q2]Uso: Ensina a fazer Dragonas da Segunda Guerra.\n[q3]Dragonas da Segunda Guerra\nVincula-se quando equipado\nOmbros Malha\n163 Armadura\n+8 Vigor\nDurabilidade 70 / 70\nRequer Nível 25\n[q2]Equipar: Aumenta em até 11 o dano causado por feitiços e efeitos Sagrados.\nRequer Barra de Bronze (20), Ágata Musgosa (2), Pedra-da-lua Inferior (2), Pérola Iridescente (2), Barra de Prata (4)"},
[210781] = {name = "[q3]Braceletes da Fênix", additional_info = "Vincula-se quando equipado\nPulsos Tecido\n21 Armadura\nDurabilidade 30 / 30\nRequer Nível 25\n[q2]Equipar: Aumenta em até 13 o dano causado por feitiços e efeitos de Fogo."},
[210794] = {name = "[q4]Peitoral de Prata Cambiante", additional_info = "Vincula-se ao ser recolhido\nÚnico-equipado: [Void-Touched] (1)\nTorso Malha\n238 Armadura\n+12 Força\n+5 Vigor\nDurabilidade 145 / 145\nRequer Nível 25\nRequer Ferraria (100)\n[q2]Equipar: Este item é imbuído com o poder bruto do Caos. Quando o portador é atacado, o item tem chance elevada de causar uma maldição terrível, fazendo o atacante receber dano adicional de todas as fontes por 15 s. (Chance de ativar:25%)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques."},
[210795] = {name = "[q4]Botas de Sedaracna Extraplanares", additional_info = "Vincula-se ao ser recolhido\nÚnico-equipado: [Void-Touched] (1)\nPés Tecido\n35 Armadura\n+5 Vigor\n+5 Intelecto\n+6 Espírito\nDurabilidade 50 / 50\nRequer Nível 25\nRequer Alfaiataria (100)\n[q2]Uso: Entra temporariamente em outro plano de existência, reduzindo instantaneamente a ameaça, além de reduzir em 30% todo o dano recebido e causado por 6 sec. (10 Min Recarga)\n[q2]Equipar: Aumenta em até 7 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques."},
[210811] = {name = "[q2]Runa da Fúria Primordial", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava na calça a runa de Fúria Xamanística:\n\n\nReduz em 20% todo o dano que você recebe e você regenera mana equivalente a 5% do seu máximo de pontos de mana a cada segundo por 15 sec. Os integrantes do seu grupo ou raide em um raio de 40 m também recebem 20% do mana que você recebe dessa forma.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210817] = {name = "[q2]Runa da Sobrevivência", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Grava na veste ou peitoral a runa de Lei da Selva:\n\n\nReduz em 6% a chance de você receber acertos críticos de ataques corpo a corpo e em 10% todo o dano recebido. Dano recebido reduzido em mais 10% na Forma de Urso ou de Urso Hediondo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210818] = {name = "[q2]Runa do Lobo Solitário", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na veste ou no peitoral a runa de Lobo Solitário:\n\n\nVocê causa 30% a mais de dano com todos os ataques quando não tiver um ajudante ativo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210820] = {name = "[q2]Runa do Sacrifício", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava na calça a runa de Sacrifício Divino:\n\n\n30% de todo dano recebido pelos integrantes do grupo que estejam em um raio de 30 m é redirecionado para o Paladino por 10 sec. Qualquer dano que reduza os pontos de vida do Paladino para menos de 20% interrompem o efeito e concedem ao Paladino 10% a mais de dano e cura por 10 sec. Sacrifício Divino não pode ser usado quando você está sob efeito de Bênção de Proteção, Escudo Divino ou Proteção Divina, e impede você de ser alvo dessas habilidades quando está ativo.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210822] = {name = "[q2]Epifania Harmoniosa", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na veste ou no peitoral a runa de Serendipidade:\n\n\nCurar com Cura Célere reduz em 20% o tempo de lançamento da sua próxima Cura Inferior, Cura, Cura Maior ou Prece de Cura por 20 sec, acumulando até 3 vezes.\n[q]\"Aprenda uma nova habilidade de Gravura.\""},
[210823] = {name = "[q2]Runa de Especialização em Duas Armas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava na veste ou no peitoral a runa de Especialização em Duas Armas:\n\n\nAumenta em 10% a chance de acertar com ataques corpo a corpo e feitiços enquanto estiver empunhando duas armas, a habilidade Ataque da Tempestade agora acerta com ambas as armas e aumenta em 50% o dano causado pela sua arma secundária.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210824] = {name = "[q2]Runa do Pacto", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na calça a runa de Pacto Demoníaco:\n\n\nOs acertos críticos do seu ajudante aplicam o efeito de Pacto Demoníaco aos integrantes do grupo por 45 sec. Pacto Demoníaco aumenta o dano mágico e a cura em 10% do seu dano mágico ou ( 60 / 2), o que for maior. Não funciona em demônios Subjugados.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210825] = {name = "[q2]Runa do Armipotente", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava no peitoral a runa de Armipotente:\n\n\nSuas habilidades Investida, Interceptar e Comprar Briga podem ser usadas em combate e em qualquer postura. Todas removem qualquer efeito que dificulte o movimento quando ativadas.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210953] = {name = "Olho de Bhossca", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Embora o olho seja inanimado, você sente sua mirada...\""},
[210955] = {name = "Uniforme de Iniciado Escarlate", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Põe um disfarce de membro da Cruzada Escarlate. Atividade suspeita quebra o disfarce."},
[210963] = {name = "Chave dos Áugures", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino"},
[210966] = {name = "Sangue da Legião", additional_info = "Item de missão\nÚnico (10)\n[q]\"Grosso e escuro... Esse sangue tem origem nos grandes comandantes da Legião.\""},
[210967] = {name = "Mensagem Confidencial", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]<Clique com o Botão Direito para Ler>"},
[210968] = {name = "Chave do Relicário", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino"},
[210979] = {name = "[q2]Runa do Passo Furtivo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava no cinto a runa de Passo Furtivo:\n\n\nTenta caminhar pelo plano elemental das sombras e reaparecer atrás do seu inimigo. Aumenta em 70% a velocidade de movimento por 3 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[210980] = {name = "[q2]Runa da Metamorfose", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava nas luvas a runa de Metamorfose:\n\n\nTransforma-se em Demônio, aumentando em 500% a Armadura, reduzindo em 6% a chance de receber acertos críticos, aumentando em 50% a ameaça, aumentando em 100% o mana concedido por Conversão de Vida, transformando a funcionalidade de algumas habilidades e concedendo algumas novas:\n\n Dor Lancinante: agora é instantânea.\n\n Seta Sombria: vira Cutilada Sombria, um ataque corpo a corpo de Sombra que atinge até 3 inimigos próximos, mas tem recarga de 6 s.\n\n Medo: substituído por Ameaça.\n\n\nProvoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você.\n\n Investida Demoníaca\n\n\nInveste contra um inimigo e o atordoa por 1 sec. Não pode ser usado em combate.\n\n Uivo Demoníaco\n\n\nForça todos os inimigos próximos a concentrarem os ataques em você por 6 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211205] = {name = "[q2]Runa do Coração de Leão", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na veste ou no peitoral a runa do Coração de Leão:\n\n\nO Caçador invoca o coração do leão, aumentando em 10% o total de atributos de todos os aliados próximos e aumentando em 10% o total de atributos do Caçador.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211247] = {name = "[q2]Molde: Braceletes da Fênix", additional_info = "Vincula-se ao ser recolhido\nRequer Alfaiataria (125)\n[q2]Uso: Ensina a confeccionar Braceletes da Fênix.\n[q3]Braceletes da Fênix\nVincula-se quando equipado\nPulsos Tecido\n21 Armadura\nDurabilidade 30 / 30\nRequer Nível 25\n[q2]Equipar: Aumenta em até 13 o dano causado por feitiços e efeitos de Fogo.\nRequer Peça de Lã (6), Frasco de Óleo (2), Fio Delicado (2)"},
[211263] = {name = "[q4]Couraça do Julgamento", additional_info = "Vincula-se ao ser recolhido\nTorso Placas\n857 Armadura\n+17 Força\n+25 Vigor\n+20 Intelecto\n+10 de resistência a Fogo\n+10 de resistência a Natureza\nDurabilidade 165 / 165Classes: Paladino\nRequer Nível 60\n[q2]Equipar: Defesa aumentada em 6.\n[q2]Equipar: Aumenta em até 14 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Aumenta em 32 o valor de bloqueio do seu escudo.\n\n[q]Reduto do Julgamento (0/8)\n[q0]Cinto do Julgamento\nBraçadeiras do Julgamento\nCouraça do Julgamento\nCoroa do Julgamento\nManoplas do Julgamento\nCoxotes do Julgamento\nEscarpes do Julgamento\nEspaldares do Julgamento\n[q0](3) Conjunto : Aumenta em 10 o raio das auras do Paladino.\n(5) Conjunto : Aumenta em até 47 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n(8) Conjunto : Causa mais 60 to 66 de dano Sagrado ao alvo do Julgamento de um Paladino."},
[211269] = {name = "Desenho Primitivo", additional_info = "Vincula-se ao ser recolhido\nEsse Item Começa uma Missão"},
[211301] = {name = "[q2]Runa de Expor Fraqueza", additional_info = "Vincula-se ao ser recolhido\nClasses: Caçador\n[q2]Grava no cinto a runa de Expor Fraqueza:\n\n\nSeus acertos críticos corpo a corpo e de longo alcance aumentam o poder de ataque em 40% da sua Agilidade atual por 7 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211315] = {name = "[q2]Suprimentos Escondidos: Couro Leve", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Waylaid Shipment] (12)\n[q2]Uso: Adiciona 14 Couros Leves para completar a remessa."},
