[211329] = {name = "[q2]Suprimentos Escondidos: Ovo Assado com Ervas", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Waylaid Shipment] (12)\n[q2]Uso: Adiciona 20 Ovos Assados com Ervas para completar a remessa."},
[211330] = {name = "[q2]Suprimentos Escondidos: Carne Temperada de Lobo", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Waylaid Shipment] (12)\n[q2]Uso: Adiciona 20 Carnes Temperadas de Lobo para completar a remessa."},
[211331] = {name = "[q2]Suprimentos Escondidos: Peixinho Brilhante", additional_info = "Vincula-se ao ser recolhido\nÚnico: [Waylaid Shipment] (12)\n[q2]Uso: Adiciona 20 Peixinhos Brilhantes para completar a remessa."},
