[211368] = {name = "[q2]Remessa de Suprimentos", additional_info = "Vincula-se ao ser recolhido\n[q]\"Entregue para um oficial de suprimentos para receber uma vultosa recompensa.\""},
[211382] = {name = "Algibeira de Mensageiro Pequena", additional_info = "Vincula-se ao ser recolhido\nÚnico\n10 Compartimento Bolsa"},
[211384] = {name = "[q2]Bolsa de Mensageiro Resistente", additional_info = "Vincula-se ao ser recolhido\nÚnico\n12 Compartimento Bolsa"},
[211385] = {name = "[q2]Runa de Espalhar de Serpente", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]Grava na calça a runa de Espalhar de Serpente:\n\n\nAlvos atingidos pelo seu Tiro Múltiplo também são afetados pela sua Picada de Serpente por 6 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211386] = {name = "[q2]Anotações de Feitiços: Surto Arcano", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava na calça a runa de Surto Arcano:\n\n\nLibera todo o seu mana restante em um surto de energia focalizado no alvo, causando de [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 226 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 264 / 100] de dano Arcano, que pode aumentar até 300% com base no seu mana restante. Em seguida, sua regeneração de mana normal é ativada e aumentada em 300% por 8 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211387] = {name = "[q2]Runa de Luz Estupenda", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava nas luvas a runa de Foco de Luz:\n\n\nO alvo se torna um Foco de Luz para todos os integrantes do raide ou grupo num raio de 40 m. Qualquer cura que você lançar nos integrantes do raide ou grupo também cura o Foco em 100% do total curado. Somente um alvo pode ser o Foco de Luz por vez. Dura 1 min.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211390] = {name = "[q2]Runa de Provocação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Grava na veste ou no peitoral a runa de Só Um Arranhão:\n\n\nVocê recebe dano físico reduzido em 20% enquanto Dança de Lâminas está ativa. Além disso, sua chance de sofrer um acerto crítico de ataques corpo a corpo é reduzida em 6%, a ameaça gerada por todas as suas ações é imensamente aumentada e sua habilidade Finta é substituída por Caçoar, que Provoca o alvo a atacar você.\n\n\nProvoca o alvo, fazendo-o atacar você, mas não tem efeito se o alvo já estiver atacando você.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211391] = {name = "[q2]Runa de Chuva Curativa", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava na veste ou no peitoral a runa de Chuva Curativa:\n\n\nSeleciona uma área de 15 m ao redor do alvo e cura [(29.888200 + 0.690312 * 60 + 0.136267 * 60 * 60) * 15 / 100] pontos de vida a cada segundo de todos os integrantes do grupo dele dentro da área.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211392] = {name = "[q2]Runa de Agonia Eterna", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na calça a runa de Agonia Eterna:\n\n\nDrenar Vida, Drenar Alma, Seta Sombria, Cutilada Sombria, Dor Lancinante, Incinerar e Assombrar renovam a duração da sua Corrupção no alvo de volta para a duração máxima.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211393] = {name = "[q2]Runa de Fúria Obcecada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]Grava nas luvas a runa de Fúria Obcecada:\n\n\nCom armas empunhadas nas duas mãos, seu dano Físico e sua velocidade de movimento aumentam em 10%.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211419] = {name = "[q2]Punhado de Escamas Cambiantes", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Essas escamas curiosas parecem cintilar levemente, como se não estivessem inteiramente ancoradas no mundo material. Claramente há uma magia maravilhosa agindo aqui. Seria ótimo encontrar alguém que saiba mais sobre isso...\""},
[211420] = {name = "[q3]Talismã de Escama Cambiante", additional_info = "Vincula-se ao ser recolhido\nBerloque\n+5 Espírito\nRequer Nível 25\n[q2]Equipar: Protege o portador dos efeitos da Escuridão Esmagadora."},
[211421] = {name = "A Caixa", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Tenta usar uma fonte poderosa da Luz para destruir a Caixa.\n[q]\"Tocar a caixa com as próprias mãos enche você imediatamente com uma profunda inquietação... mas também com uma inspiração criativa como você nunca sentiu.\""},
[211422] = {name = "[q4]Estilhaço do Caos", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Tudo que resta da caixa é uma estilha minúscula de cristal perfeitamente negro. Ela parece atrair e consumir a luz.\""},
[211423] = {name = "[q4]Luvas de Couro Tocadas pelo Caos", additional_info = "Vincula-se ao ser recolhido\nÚnico-equipado: [Void-Touched] (1)\nMãos Couro\n[q2]110 Armadura\n+6 Agilidade\n+6 Vigor\n+4 Espírito\nDurabilidade 70 / 70\nRequer Nível 25\nRequer Couraria (100)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Uso: Mergulha na loucura, aumentando em 10% a velocidade de ataque, além de aumentar a ameaça que você gera em 10 sec. (10 Min Recarga)"},
[211427] = {name = "[q3]Receptáculo de Alma", additional_info = "[q]\"Aprisiona almas de demônios e absorve poder delas.\""},
[211443] = {name = "[q2]Lâmina da Raiva", additional_info = "Vincula-se ao ser recolhido\nDuas mãos Espada\n31 - 47 de dano Velocidade 3.50\n(11.14 de dano por segundo)\n50 Armadura\n+3 Força\nDurabilidade 60 / 60\nRequer Nível 13"},
[211444] = {name = "[q2]Manto do Evocador", additional_info = "Vincula-se ao ser recolhido\nCostas\n16 Armadura\n+3 Intelecto\n+1 Espírito\nRequer Nível 13"},
[211445] = {name = "[q2]Arco Recurvo Bárbaro", additional_info = "Vincula-se ao ser recolhido\nLongo alcance Arco\n12 - 24 de dano Velocidade 2.40\n(7.50 de dano por segundo)\nDurabilidade 50 / 50\nRequer Nível 13"},
[211447] = {name = "Carregamento de Armas", additional_info = "Item de missão\nÚnico"},
