[211472] = {name = "[q2]Incunábulo do Banimento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\nRequer Nível 24\n[q2]Grava na calça a runa de Exorcista:\n\n\nAgora é possível lançar Exorcismo contra qualquer alvo, com 100% a mais de chance de acerto crítico contra Mortos-vivos e Demônios.\n[q]\"Aprende uma nova habilidade após lançar Esconjurar Morto-vivo em 5 inimigos e dizimá-los com Exorcismo.\""},
[211476] = {name = "[q2]Rastro das Runas do Fogo", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na veste ou no peitoral a runa de Lago de Fogo:\n\n\nChuva de Fogo também deixa no chão, depois que for canalizada completamente, um Lago de Fogo que aumenta em 50% todo o dano de Fogo que você e seu demônio ajudante causam aos inimigos afetados por 15 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211477] = {name = "[q2]Runa de Incinerar", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Grava na calça a runa de Incinerar:\n\n\nQueima o inimigo, causando de [222 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] a [258 / 100 * (6.568597 + 0.672028 * 60 + 0.031721 * 60 * 60)] de dano e aumentando em 25% todo o dano de Fogo que você causa pelos próximos 15 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211482] = {name = "Oferenda da Lança Partida", additional_info = "Vincula-se ao ser recolhido\nÚnico"},
[211487] = {name = "[q2]Explosivos de Demolição", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Põe uma bomba de pavio curto no chão à sua frente.\n[q]\"Só parecem ser úteis para remover destroços e escombros.\""},
[211488] = {name = "[q2]Runa do Vingador", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Grava na calça a runa de Escudo do Vingador:\n\n\nAtira um escudo sagrado contra o inimigo, causando [366 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] a [448 * (9.046514 + 0.676562 * 60 + 0.019349 * 60 * 60) / 100 + 0.091 * Spell power + 0.091 * Attack power] de dano Sagrado e estonteando-o para, então, pular para os inimigos próximos. Afeta um total de 3 alvos. Dura 10 sec.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211490] = {name = "[q2]Profecia de Milhares de Luzes", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava nas luvas a runa de Círculo de Cura:\n\n\nCura de [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 130 / 100] a [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 144 / 100] pontos de vida de todos os integrantes do grupo em um raio de 40 m do jogador selecionado.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth.\n[q]\"Aprenda uma nova habilidade de Gravura.\""},
