[211501] = {name = "[q4]Couraça do Poder", additional_info = "Vincula-se ao ser recolhido\nTorso Placas\n749 Armadura\n+27 Força\n+18 Vigor\n+10 de resistência a Fogo\nDurabilidade 165 / 165Classes: Guerreiro\nRequer Nível 60\n[q2]Equipar: Aumenta em 1% a chance de realizar acertos críticos.\n[q2]Equipar: Aumenta em 1% a chance de acerto.\n\n[q]Loriga do Poder (0/8)\n[q0]Cinto do Poder\nBraçadeiras do Poder\nCouraça do Poder\nManoplas do Poder\nElmo do Poder\nCoxotes do Poder\nBrafoneiras do Poder\nEscarpes do Poder\n[q0](3) Conjunto : Aumenta em 30 o valor de bloqueio do seu escudo.\n(5) Conjunto : Você tem 20% de chance de gerar mais um ponto de Raiva sempre que receber dano. (Chance de ativar:20%)\n(8) Conjunto : Aumenta em 15% a ameaça gerada por Fender Armadura."},
[211502] = {name = "[q4]Manoplas de Couro Tocadas pelo Caos", additional_info = "Vincula-se ao ser recolhido\nÚnico-equipado: [Void-Touched] (1)\nMãos Couro\n70 Armadura\n+5 Vigor\n+7 Intelecto\n+6 Espírito\nDurabilidade 70 / 70\nRequer Nível 25\nRequer Couraria (100)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Uso: Mergulha na loucura, aumentando em 10% o dano mágico, além de aumentar a ameaça que você gera em 10 sec. (10 Min Recarga)"},
