[211514] = {name = "[q2]Anotações de feitiços: Regeneração em Massa", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava na calça a runa de Regeneração em Massa:\n\n\nCura [(38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) * 42 / 100 * 3] pontos de vida de todos os membros do grupo do jogador selecionado em um raio de 30 m dele ao longo de 3 sec, e aplica Foco Temporal em cada alvo por 15 s.\n\n Foco Temporal\n\nGrava a posição do alvo no espaço-tempo. 80% de todo o dano Arcano causado pelo lançador será convertido em cura cronomântica em cada um dos alvos atuais com Focos Temporais. Essa cura é 50% menor quando aplicada em si mesmo e 80% menor quando o dano é causado por feitiços Arcanos que causam dano a vários alvos.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[211528] = {name = "Percepção Sombria", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Uso: Reflete em uma sepultura solitária na Floresta do Crepúsculo para receber uma profecia."},
[211530] = {name = "[q2]Profecia de uma Cidade Escravizada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na calça a runa de Palavra de Poder: Barreira:\n\n\nEvoca uma barreira sagrada para proteger todos os integrantes do grupo no local selecionado por 10 sec, reduzindo em 25% todo o dano recebido e impedindo que dano retarde o lançamento de feitiços.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[211531] = {name = "[q2]Profecia dos Sete Visitantes", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava na veste ou peitoral a runa de Força da Alma:\n\n\nCura Inferior, Cura, Cura Maior e Cura Célere reduzem em 4 s a duração restante de Alma Enfraquecida nos alvos que curam. Além disso, alvos da sua Palavra de Poder: Escudo ganham Raiva ao receber dano, independentemente de o dano ser absorvido, e Fúria Íntegra se ativa com dano absorvido pela sua Palavra de Poder: Escudo como se fosse uma cura.\n[q2]Uso: Foca na Profecia para aprender um novo feitiço. Requer uma mente focada por meio da meditação em dois mistérios espirituais de Azeroth."},
[211534] = {name = "Percepção Primeva", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Uso: Reflete em um apanhador de sonhos Pelocardo no alto da copa das árvores para receber uma profecia."},
[211691] = {name = "[q2]Anotações de Feitiços: Impacto Arcano", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Grava nas luvas a runa de Impacto Arcano:\n\n\nAtaca o alvo com energia, causando [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 453 / 100] a [(13.828124 + 0.018012 * 60 + 0.044141 * 60 * 60) * 527 / 100] de dano Arcano. Cada vez que você lançar Impacto Arcano, o dano e a cura de todos os outros feitiços Arcanos serão aumentados em 15%, e o custo de mana de Impacto Arcano aumentará em 175%. O efeito acumula até 4 vezes. Dura 6 sec ou até que qualquer outro feitiço de dano Arcano ou cura seja lançado.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
