[213442] = {name = "[q3]Garra do Engrenomestre", additional_info = "Vincula-se ao ser recolhido\nMão Secundária Arma de Punho\n60 - 111 de dano Velocidade 2.80\n(30.54 de dano por segundo)\n+6 Força\n+6 Agilidade\n+5 Vigor\nDurabilidade 90 / 90\nRequer Nível 40"},
[213443] = {name = "Presente Tiquetaqueante", additional_info = "Vincula-se ao ser recolhido\n[q2]<Clique com o Botão Direito para Abrir>"},
[213452] = {name = "[q2]Runa Sagrada Dormente", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q]\"Primeiro, você precisa trocar sua vida por outro. Depois, antes que seu espírito parta, retribua a salvação à altura.\""},
[213513] = {name = "[q2]Incunábulo da Libertação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Livreto\nClasses: Paladino\nRequer Nível 18\n[q2]Grava nas botas a runa de Escudo Sagrado:\n\n\nToda vez que recebe dano, o alvo ganha um Escudo Sagrado que absorve [36 * (38.258376 + 0.904195 * 60 + 0.161311 * 60 * 60) / 100] de dano e aumenta em 50% a chance de acerto crítico do Paladino com Clarão de Luz por 6 sec. Além disso, faz seu Clarão de Luz curar mais 100% dos pontos de vida dos alvos com Escudo Sagrado ao longo de 12 sec. Não é possível ganhar este efeito mais de uma vez a cada 6 s. Dura 30 sec. Este feitiço não pode afetar mais de um alvo por vez.\n[q]\"Aprende uma nova habilidade após usar a Bênção da Liberdade para libertar outros de efeitos que prejudicam o movimento 5 vezes.\""},
[213526] = {name = "Pernil Híbrido", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Tem gosto de carne vermelha *e* branca.\""},
[213527] = {name = "Mistura de Temperos do Contrabandista", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"A joia da coroa da galé de qualquer navio. Deixa até uma bota saborosa.\""},
[213528] = {name = "Cerveja Balsâmica", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Não é exatamente uma \"gelada\".\""},
[213529] = {name = "Veneno Viscoso", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Come bichos do pântano como se não fosse nada. Excelente para marinadas!\"\nSaqueado de: Tarântula Mataca\nChance de Saque: 0.48%"},
[213542] = {name = "[q3]Necro-gnomicon", additional_info = "Vincula-se ao ser recolhido\nEmpunhado na mão secundária\n+2 Intelecto\n+2 Espírito\n+3 de resistência a Sombra\nRequer Nível 40\n[q2]Equipar: Aumenta em até 14 o dano causado e a cura realizada por feitiços e efeitos mágicos."},
[213543] = {name = "Pergaminho: FALAÊ", additional_info = "Classes: Mago\n[q2]Uso: Decifra o pergaminho com um Patuá da Compreensão. Vai saber que magia isso contém?"},
[213544] = {name = "Pergaminho: DASTEFO RIÃTORLIM", additional_info = "Classes: Mago\n[q2]Uso: Decifra o pergaminho com um Patuá da Compreensão. Vai saber que magia isso contém?"},
