[213548] = {name = "Pergaminho de Passagem Liminar", additional_info = "Classes: Mago\nRequer Nível 6\n[q2]Uso: Teleporte para um integrante do grupo. Você e o alvo devem estar descansando em uma estalagem ou cidade."},
[213549] = {name = "Pergaminho de Pesca Arcana", additional_info = "Classes: Mago\nRequer Nível 12"},
[213550] = {name = "Pergaminho de Polimorfia: Melão Estranho", additional_info = "Vincula-se ao ser recolhido\nClasses: Mago\nRequer Nível 16\n[q2]Uso: Polimorfa o alvo em um Melão Estranho. (5 Seg Recarga)"},
[213551] = {name = "Pergaminho do Deslocamento Controlado", additional_info = "Classes: Mago\nRequer Nível 12"},
[213552] = {name = "Lágrima de Theradras", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Guardadas e protegidas pela tribo de centauros Gelkis, dizem que concedem a quem as porta a proteção dos espíritos da terra.\""},
[213553] = {name = "Lágrima de Theradras", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Guardadas e protegidas pela tribo de centauros Gelkis, dizem que concedem a quem as porta a proteção dos espíritos da terra.\""},
[213554] = {name = "Ampola de Água Cristalina", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Misture com Lágrimas de Theradras para criar um Bálsamo Elemental capaz de purificar corrupção.\n[q]\"A água é tão cristalina que a ampola parece vazia.\""},
[213558] = {name = "Bálsamo Elemental", additional_info = "[q2]Uso: Derrame sobre objetos corrompidos para purificá-los.\n[q]\"Um bálsamo potente, capaz de purificar corrupção profunda.\""},
[213559] = {name = "[q3]Câmbio de Mecanostruz", additional_info = "Vincula-se ao ser recolhido\nLongo alcance Varinha\n44 - 83 de dano tipo Arcano Velocidade 1.50\n(42.33 de dano por segundo)\nDurabilidade 65 / 65\nRequer Nível 40\n[q2]Equipar: Aumenta em até 9 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q]\"Este item sugere a existência de mecanostruzes com câmbio manual.\""},
[213560] = {name = "[q3]Silenciador de Mecanostruz", additional_info = "Vincula-se ao ser recolhido\nUma Mão Maça\n51 - 95 de dano Velocidade 2.40\n(30.42 de dano por segundo)\n+7 Vigor\nDurabilidade 90 / 90\nRequer Nível 40\n[q2]Equipar: +16 de Poder de Ataque."},
[213563] = {name = "Guia de Campo", additional_info = "Vincula-se ao ser recolhido\n[q2]<Clique com o Botão Direito para Ler>"},
[213564] = {name = "Pergaminho da Evocação Menor", additional_info = "Classes: Mago\n[q2]Uso: Restaura mana. (8 Min Recarga)"},
[213565] = {name = "Kit Básico de Entomologia", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador , Druida\n[q2]<Clique com o Botão Direito para Abrir>"},
[213583] = {name = "[q2]Entalhe com Enxofre", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q]\"Parece que o dono anterior brincou com fogo até demais.\""},
[213594] = {name = "[q2]Ídolo da Interpelação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nRelíquia Ídolo\nClasses: Druida\nRequer Nível 28\n[q2]Grava no cinto a runa de Berserk:\n\n\nAo ser ativada, faz suas habilidades Destroçar (Urso) e Lacerar atingirem até 3 alvos, Lacerar não custar Raiva, e Destroçar (Urso) não ter recarga. Também reduz em 50% o custo de energia de todas as habilidades da sua Forma de Felino. Dura 15 sec. Requer Forma de Urso, Forma de Felino ou Forma de Urso Hediondo para se ativar.\n\n Remove Medo e concede imunidade a esse efeito por toda a duração.\n[q]\"Provoque 2 ou mais inimigos com Rugido Desafiador e mate pelo menos um. Depois de 3 abates, use este ídolo para aprender uma nova habilidade.\""},
[213599] = {name = "[q2]Visão Perturbadora", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Grava no cinto a runa de Esperança Renovada:\n\n\nSuas curas com Cura Célere, Cura Inferior, Cura, Cura Maior e Penitência têm 10% a mais de chance de efeito crítico quando são lançadas em alvos com Alma Enfraquecida.\n[q2]Uso: Foca na Visão para aprender um novo feitiço. Requer um vislumbre de conhecimento corrompido."},
[213632] = {name = "[q2]Anotações de Feitiços Parciais", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Combina as Anotações de Feitiços Parciais coletadas em um pergaminho que ensina um novo feitiço de Gravura.\n[q]\"Uma página incompleta parecida com os pergaminhos que ensinam habilidades de Gravação. Dois terços dela estão faltando.\"\nSaqueado de: [Scorched Screeching Roguefeather]\nChance de Saque: 87.58%"},
[213633] = {name = "[q2]Anotações de Feitiços Parciais", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Combina as Anotações de Feitiços Parciais coletadas em um pergaminho que ensina um novo feitiço de Gravura.\n[q]\"Uma página incompleta parecida com os pergaminhos que ensinam habilidades de Gravação. Dois terços dela estão faltando.\"\nSaqueado de: [Singed Highperch Consort]\nChance de Saque: 88.89%"},
[213634] = {name = "[q2]Anotações de Feitiços Parciais", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Combina as Anotações de Feitiços Parciais coletadas em um pergaminho que ensina um novo feitiço de Gravura.\n[q]\"Uma página incompleta parecida com os pergaminhos que ensinam habilidades de Gravação. Dois terços dela estão faltando.\"\nSaqueado de: [Seared Needles Cougar]\nChance de Saque: 87.84%"},
[213641] = {name = "[q3]Caixa de Sucata de Gnomeregan", additional_info = "Vincula-se ao ser recolhido\n[q]\"Esta caixa de Sucata de Gnomeregan pode ter algo útil para a sua profissão.\"\n[q2]<Clique com o Botão Direito para Abrir>"},
[213701] = {name = "Pena Resistente de Harpia", additional_info = "Vincula-se ao ser recolhido\nÚnico (10)\n[q2]Uso: Combina 10 Penas de Harpia Forte e 3 Presas de Serpente das Nuvens com 1 Fio de Seda para criar uma Oferenda ao Espírito do Vento."},
[213709] = {name = "Presa de Serpente das Nuvens", additional_info = "Vincula-se ao ser recolhido\nÚnico (3)\n[q2]Uso: Combina 10 Penas de Harpia Forte e 3 Presas de Serpente das Nuvens com 1 Fio de Seda para criar uma Oferenda ao Espírito do Vento."},
[213735] = {name = "[q3]Processador N.U.C.L.E.O. G-7 Imaculado", additional_info = "Vincula-se ao ser recolhido\n[q]\"Essa coisa é capaz de pré-renderizar mais de 4 milhões de gigaflops de código relacional de baixa variância em rajadas. Nossa!\""},
[213736] = {name = "[q2]Processador N.U.C.L.E.O. G-7 Corroído", additional_info = "Vincula-se ao ser recolhido\nÚnico\nEsse Item Começa uma Missão\n[q]\"Este processador está coberto de ferrugem e uma substância preta grudenta, mas você consegue distinguir o número do modelo e algumas palavras ilegíveis no meio da meleca. Pode ser preciso um especialista para ajudar a restaurá-lo.\""},
[213737] = {name = "Oferenda ao Espírito do Vento", additional_info = "Vincula-se ao ser recolhido\nÚnico\n[q2]Uso: Faça uma oferenda ao Espírito do Vento para mostrar sua fé."},
[214435] = {name = "Chave de Jaula de Puma", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Uso: Abre a Jaula de Puma"},
[215111] = {name = "[q4]Monóculo Gneuroarticulado de Arcanofilamento", additional_info = "Vincula-se ao ser recolhido\nCabeça Tecido\n58 Armadura\n+10 Vigor\n+11 Intelecto\nDurabilidade 60 / 60\nRequer Nível 40\nRequer Alfaiataria (225)\n[q2]Equipar: Aumenta em até 22 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Restaura 4 de mana a cada 5 s.\n[q2]Uso: Controla a energia arcana latente no ar ao redor para receber uma inspiração carregada, reduzindo em 50% o custo de mana de todos os feitiços e aumentando em até 50 o dano causado e a cura realizada por 12 sec. (10 Min Recarga)"},
[215114] = {name = "[q4]Coifa de Escama Hipercondutora Luminescente", additional_info = "Vincula-se ao ser recolhido\nCabeça Malha\n242 Armadura\n+14 Vigor\n+15 Intelecto\nDurabilidade 85 / 85\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Aumenta em até 21 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Uso: Causa um choque hipercondutor, causando instantaneamente 312 to 688 de dano a si, mas também aumentando em 20% sua velocidade de lançamento de feitiços por 10 sec. (10 Min Recarga)"},
[215115] = {name = "[q4]Faixa de Ouro Hipercondutora", additional_info = "Vincula-se ao ser recolhido\nCintura Tecido\n40 Armadura\n+9 Vigor\nDurabilidade 35 / 35\nRequer Nível 40\nRequer Engenharia (225)\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Uso: Tira uma moeda hipercondutora do seu cinto para um cara ou coroa. Cara: ganha 3% a mais de chance de acerto crítico com todos os ataques e feitiços por 30 sec. Coroa: ganha 10% de velocidade de movimento por 30 sec. (15 Min Recarga)\n[q]\"O cinto emite um leve tilintar quando você se move.\""},
[215129] = {name = "[q4]Fórmula: Encantamento de Desmanche - Arma", additional_info = "Vincula-se ao ser recolhido\nRequer Encantamento (225)\n[q2]Uso: Encanta permanentemente uma arma para fazer todos os feitiços e ataques às vezes causarem 60 to 90 de dano adicional a criaturas mecânicas."},
[215138] = {name = "[q4]Fórmula: Encantamento de Re-talhação - Torso", additional_info = "Vincula-se ao ser recolhido\nRequer Encantamento (225)\n[q2]Uso: Ensina a encantar permanentemente uma peça de armadura de torso para refletir 9 de dano no atacante quando o portador é atingido em corpo a corpo."},
[215141] = {name = "[q2]Signo Encantado: Inovação", additional_info = "Vincula-se ao ser recolhido\nRequer Encantamento (225)\n[q2]Uso: Ensina a conjurar um Signo da Inovação.\n[q2]Signo Encantado: Inovação\nVincula-se ao ser recolhido\nÚnico (5)\nRequer Nível 40\nRequer Encantamento (225)\n[q2]Uso: Ganha um signo da inovação encantado que fortalece e aumenta em até 20 o dano que você causa e a cura que você realiza com feitiços, além de aumentar em 20 o poder de ataque por 30 min. Só é possível aplicar fora de combate. (30 Min Recarga)\nRequer Pó Visionário (5)"},
[215149] = {name = "[q4]Molde: Monóculo Gneuroarticulado de Arcanofilamento", additional_info = "Vincula-se ao ser recolhido\nRequer Alfaiataria (225)\n[q2]Uso: Ensina a fazer Monóculo Gneuroarticulado de Arcanofilamento.\n[q4]Monóculo Gneuroarticulado de Arcanofilamento\nVincula-se ao ser recolhido\nCabeça Tecido\n58 Armadura\n+10 Vigor\n+11 Intelecto\nDurabilidade 60 / 60\nRequer Nível 40\nRequer Alfaiataria (225)\n[q2]Equipar: Aumenta em até 22 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Restaura 4 de mana a cada 5 s.\n[q2]Uso: Controla a energia arcana latente no ar ao redor para receber uma inspiração carregada, reduzindo em 50% o custo de mana de todos os feitiços e aumentando em até 50 o dano causado e a cura realizada por 12 sec. (10 Min Recarga)\nRequer Arcanofilamento Hipercondutor (5), Couro Levemente Luminoso , Gniodina com Isolamento Térmico , Pó Visionário (10), Peça de Magitrama (10)"},
[215152] = {name = "[q4]Molde: Capucho Gneuroarticulado Luminescente", additional_info = "Vincula-se ao ser recolhido\nRequer Couraria (225)\n[q2]Uso: Ensina a fazer Capucho Gneuroarticulado Luminescente.\n[q4]Capucho Gneuroarticulado Luminescente\nVincula-se ao ser recolhido\nCabeça Couro\n118 Armadura\n+14 Agilidade\n+14 Vigor\nDurabilidade 70 / 70\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: +3 de Dano da Arma.\n[q2]Uso: Causa um choque gneuro-lógico, causando instantaneamente 343 to 757 de dano a si, mas aumentando também em 20% sua velocidade de ataque corpo a corpo e de longo alcance por 10 sec. (10 Min Recarga)\nRequer Arcanofilamento Hipercondutor , Pelego Grosso Curado (5), Fio de Seda (2), Couro Levemente Luminoso (5)"},
[215153] = {name = "[q4]Diagrama: Engrenomuralha de Veraprata Rodopiante", additional_info = "Vincula-se ao ser recolhido\nRequer Engenharia (225)\n[q2]Uso: Ensina a fazer Engrenhomuralha de Veraprata Rodopiante.\n[q4]Engrenomuralha de Veraprata Rodopiante\nVincula-se ao ser recolhido\nMão Secundária Escudo\n1760 Armadura\nBloqueio de 29\n+9 Força\n+10 Vigor\nDurabilidade 120 / 120\nRequer Nível 40\nRequer Engenharia (225)\n[q2]Equipar: Aumenta em 1% a chance de bloquear ataques com o escudo.\n[q2]Equipar: Em um bloqueio bem-sucedido, as engrenagens afiadíssimas deste escudo causam 5 to 10 de dano Físico ao atacante e 2 to 10 de dano Físico ao portador.\n[q]\"As bordas giratórias deste escudo são surpreendentemente afiadas. Parece perigoso, tanto para o atacante quanto para o portador.\"\nRequer Placas de Veraprata de Baixa Radioatividade (3), Engrenagens de Veraprata Polidas (5), Couro Levemente Luminoso (2), Carcaça de Mithril (2), Giroscronatom (2), Barra de Mithril (15)"},
[215155] = {name = "[q4]Instruções: Elmo Temperado com Cancelamento de Interferências", additional_info = "Vincula-se ao ser recolhido\nRequer Ferraria (225)\n[q2]Uso: Ensina a fazer Elmo Temperado com Cancelamento de Interferências.\n[q4]Elmo Temperado com Cancelamento de Interferências\nVincula-se ao ser recolhido\nCabeça Placas\n426 Armadura\n+20 Força\n+14 Vigor\nDurabilidade 100 / 100\nRequer Nível 40\nRequer Ferraria (225)\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Uso: Ganha concentração intensa, reduzindo em 20% a velocidade de movimento, mas aumentando em 50 sua resistência a feitiços de todas as escolas e aumentando em 20% a velocidade de ataque corpo a corpo por 10 sec. (10 Min Recarga)\n[q]\"Guaranteed to protect your brain from all threats, physical and otherwise!\"\nRequer Barra de Mithril (25), Placas de Veraprata de Baixa Radioatividade (4), Arcanofilamento Hipercondutor , Couro Levemente Luminoso (2)"},
[215156] = {name = "[q4]Diagrama: Faixa de Ouro Hipercondutora", additional_info = "Vincula-se ao ser recolhido\nRequer Engenharia (225)\n[q2]Uso: Ensina a fazer Faixa de Ouro Hipercondutora.\n[q4]Faixa de Ouro Hipercondutora\nVincula-se ao ser recolhido\nCintura Tecido\n40 Armadura\n+9 Vigor\nDurabilidade 35 / 35\nRequer Nível 40\nRequer Engenharia (225)\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Uso: Tira uma moeda hipercondutora do seu cinto para um cara ou coroa. Cara: ganha 3% a mais de chance de acerto crítico com todos os ataques e feitiços por 30 sec. Coroa: ganha 10% de velocidade de movimento por 30 sec. (15 Min Recarga)\n[q]\"O cinto emite um leve tilintar quando você se move.\"\nRequer Engrenagens de Veraprata Polidas (3), Arcanofilamento Hipercondutor (3), Couro Levemente Luminoso , Barra de Ouro (10)"},
[215161] = {name = "[q4]Elmo Temperado com Cancelamento de Interferências", additional_info = "Vincula-se ao ser recolhido\nCabeça Placas\n426 Armadura\n+20 Força\n+14 Vigor\nDurabilidade 100 / 100\nRequer Nível 40\nRequer Ferraria (225)\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Uso: Ganha concentração intensa, reduzindo em 20% a velocidade de movimento, mas aumentando em 50 sua resistência a feitiços de todas as escolas e aumentando em 20% a velocidade de ataque corpo a corpo por 10 sec. (10 Min Recarga)\n[q]\"Guaranteed to protect your brain from all threats, physical and otherwise!\""},
[215162] = {name = "Poção de Rejuvenescimento Ligeiramente Irradiada", additional_info = "Vincula-se ao ser recolhido\nRequer Nível 35\nRequer Alquimia (225)\n[q2]Uso: Restaura 262 to 438 pontos de mana e 340 to 460 pontos de vida. Também aumenta em 40 o poder de ataque e em 35 o dano causado por todos os seus feitiços por 20 sec. (2 Min Recarga)\n[q]\"Os efeitos colaterais podem incluir: tontura, boca seca, fadiga, falta de apetite, Síndrome Aguda da Radiação, mutação e morte. Use conforme as instruções.\""},
[215163] = {name = "[q4]Receita: Poção de Rejuvenescimento Ligeiramente Irradiada", additional_info = "Vincula-se ao ser recolhido\nRequer Alquimia (225)\n[q2]Uso: Ensina a preparar Poção do Rejuvenescimento Ligeiramente Irradiada.\nPoção de Rejuvenescimento Ligeiramente Irradiada\nVincula-se ao ser recolhido\nRequer Nível 35\nRequer Alquimia (225)\n[q2]Uso: Restaura 262 to 438 pontos de mana e 340 to 460 pontos de vida. Também aumenta em 40 o poder de ataque e em 35 o dano causado por todos os seus feitiços por 20 sec. (2 Min Recarga)\n[q]\"Os efeitos colaterais podem incluir: tontura, boca seca, fadiga, falta de apetite, Síndrome Aguda da Radiação, mutação e morte. Use conforme as instruções.\"\nRequer Caixote de Solução de Gniodina Maculada , Poção Menor de Rejuvenescimento , Precipitação de Gnomeregan (3), Ampola de Cristal (5)"},
[215166] = {name = "[q4]Capucho Gneuroarticulado Luminescente", additional_info = "Vincula-se ao ser recolhido\nCabeça Couro\n118 Armadura\n+14 Agilidade\n+14 Vigor\nDurabilidade 70 / 70\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: +3 de Dano da Arma.\n[q2]Uso: Causa um choque gneuro-lógico, causando instantaneamente 343 to 757 de dano a si, mas aumentando também em 20% sua velocidade de ataque corpo a corpo e de longo alcance por 10 sec. (10 Min Recarga)"},
[215257] = {name = "Pergaminho da Compreensão", additional_info = "Classes: Mago\n[q2]Uso: Cria 2 Patuás da Compreensão. Se você estiver descansando em uma estalagem ou cidade, 4 são criados."},
