[215369] = {name = "[q2]Molde: Cordão do Invocador", additional_info = "Requer Alfaiataria (150)\n[q2]Uso: Ensina a confeccionar Cordão do Invocador.\n[q2]Cordão do Invocador\nVincula-se quando equipado\nCintura Tecido\n24 Armadura\n+5 Intelecto\nDurabilidade 25 / 25\nRequer Nível 25\n[q2]Equipar: Aumenta em até 7 o dano causado e a cura realizada por feitiços e efeitos mágicos.\nRequer Peça de Seda (3), Tenebrita , Fio Delicado , Pigmento Cinza"},
