[215373] = {name = "Martelo de Treinamento do Punho de Prata", additional_info = "Duas mãos Maça\n17 - 54 de dano Velocidade 3.40\n(10.44 de dano por segundo)\nDurabilidade 65 / 65\nRequer Nível 26\n[q]\"Recuperado da Ilha de Theramore, onde o dono morreu em batalha contra hordas sanguinárias de orcs.\""},
[215374] = {name = "Espada Ancestral", additional_info = "Duas mãos Espada\n17 - 46 de dano Velocidade 3.10\n(10.16 de dano por segundo)\nDurabilidade 65 / 65\nRequer Nível 26\n[q]\"Originalmente possuída por uma nobre família de Lordaeron. Acreditava-se estar perdida nos pântanos ao redor de Kyross com seu último possuidor.\""},
[215375] = {name = "Cajado Tático", additional_info = "Duas mãos Cajado\n16 - 49 de dano Velocidade 3.50\n(9.29 de dano por segundo)\nDurabilidade 65 / 65\nRequer Nível 26\n[q]\"O profundo domínio tático da possuidora nos campos de batalha era comparável apenas a sua maestria assombrosa do gelo e do fogo.\""},
[215376] = {name = "Maça do Cruzado", additional_info = "Mão principal Maça\n21 - 36 de dano Velocidade 2.90\n(9.83 de dano por segundo)\nDurabilidade 65 / 65\nRequer Nível 26\n[q]\"Salpicada com restos secos de carapaça de inseto.\""},
[215377] = {name = "[q3]Veste Irradiada", additional_info = "Vincula-se ao ser recolhido\nTorso Tecido\n65 Armadura\n-5 Força\n-10 Vigor\n+7 Intelecto\n+8 Espírito\n+7 de resistência a Natureza\nDurabilidade 80 / 80\nRequer Nível 40\n[q2]Equipar: Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n[q2]Equipar: Aumenta em até 23 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n\n[q]Traje Irradiado (0/3)\n[q0]Veste Irradiada\nCalçotes Irradiados\nBotas Irradiadas\n[q0](2) Conjunto : -5 de Vigor.\n(2) Conjunto : Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n(3) Conjunto : Aumenta em até 11 o dano causado e a cura realizada por feitiços e efeitos mágicos."},
[215378] = {name = "[q0]Botas Irradiadas", additional_info = "Vincula-se ao ser recolhido\nPés Tecido\n45 Armadura\n-5 Agilidade\n-10 Vigor\n+12 Intelecto\n+11 Espírito\nDurabilidade 40 / 40\nRequer Nível 40\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: Aumenta em até 11 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n\n[q]Traje Irradiado (0/3)\n[q0]Veste Irradiada\nCalçotes Irradiados\nBotas Irradiadas\n[q0](2) Conjunto : -5 de Vigor.\n(2) Conjunto : Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n(3) Conjunto : Aumenta em até 11 o dano causado e a cura realizada por feitiços e efeitos mágicos."},
[215379] = {name = "[q3]Calçotes Irradiados", additional_info = "Vincula-se ao ser recolhido\nPernas Tecido\n57 Armadura\n-5 Agilidade\n-10 Vigor\n+10 Intelecto\n+13 Espírito\n+10 de resistência a Natureza\nDurabilidade 75 / 75\nRequer Nível 40\n[q2]Equipar: Aumenta em até 16 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Equipar: Restaura 4 de mana a cada 5 s.\n\n[q]Traje Irradiado (0/3)\n[q0]Veste Irradiada\nCalçotes Irradiados\nBotas Irradiadas\n[q0](2) Conjunto : -5 de Vigor.\n(2) Conjunto : Aumenta em 1% sua chance de obter acerto crítico com todos os feitiços e ataques.\n(3) Conjunto : Aumenta em até 11 o dano causado e a cura realizada por feitiços e efeitos mágicos."},
[215380] = {name = "[q4]Cinto para Levantamento de Peso Assistido", additional_info = "Vincula-se ao ser recolhido\nCintura Malha\n168 Armadura\n+14 Força\n+15 Vigor\nDurabilidade 50 / 50\nRequer Nível 40\n[q2]Equipar: Aumenta em 3 a perícia em Machados de Duas Mãos.\n[q2]Equipar: Aumenta em 3 a perícia em Espadas de Duas Mãos.\n[q2]Equipar: Aumenta em 3 a perícia em Maças de Duas Mãos."},
[215381] = {name = "[q4]Capuz Gneurocondutor do Canalizador", additional_info = "Vincula-se ao ser recolhido\nCabeça Couro\n118 Armadura\n+11 Vigor\n+12 Intelecto\n+11 Espírito\nDurabilidade 70 / 70\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Aumenta em até 21 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Uso: Ganha meditação gneuromante, permitindo que 100% da sua regeneração de mana continue durante o lançamento de feitiços e aumentando em até 50 o dano causado e a cura realizada com feitiços por 20 sec. (10 Min Recarga)"},
[215382] = {name = "[q4]Capuz de Escamas com Resistência à Radiação", additional_info = "Vincula-se ao ser recolhido\nCabeça Malha\n[q2]342 Armadura\n+10 Vigor\n+10 Intelecto\nDurabilidade 85 / 85\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: +32 de Poder de Ataque.\n[q2]Uso: Aciona os protocolos de mitigação de radiação do capacete, fazendo você remover imediatamente todos os efeitos de veneno ativos e ganhar imunidade a dano de Natureza por 3 sec. (10 Min Recarga)"},
[215383] = {name = "[q4]Instruções: Guarda-cérebro de Veraprata Refletor", additional_info = "Vincula-se ao ser recolhido\nRequer Ferraria (225)\n[q2]Uso: Ensina a fazer Guarda-cérebro de Veraprata Refletor.\n[q4][Reflective Truesilver Braincage]\nVincula-se ao ser recolhido\nCabeça Placas\n426 Armadura\n+14 Vigor\n+15 Intelecto\nDurabilidade 100 / 100\nRequer Nível 40\nRequer Ferraria (225)\n[q2]Equipar: Aumenta em até 21 o dano causado e a cura realizada por feitiços e efeitos mágicos.\n[q2]Uso: Ganha força de vontade reforçada, impedindo efeitos de silêncio, interrupção e retardo de feitiços por 10 sec. (10 Min Recarga)\nRequer Barra de Mithril (25), Placas de Veraprata de Baixa Radioatividade (4), Arcanofilamento Hipercondutor (2), Engrenagens de Veraprata Polidas"},
