[215424] = {name = "[q4]Molde: Capuz de Escamas com Resistência à Radiação", additional_info = "Vincula-se ao ser recolhido\nRequer Couraria (225)\n[q2]Uso: Ensina a fazer Capuz de Escamas com Resistência à Radiação.\n[q4]Capuz de Escamas com Resistência à Radiação\nVincula-se ao ser recolhido\nCabeça Malha\n[q2]342 Armadura\n+10 Vigor\n+10 Intelecto\nDurabilidade 85 / 85\nRequer Nível 40\nRequer Couraria (225)\n[q2]Equipar: Melhora em 1% sua chance de acerto com todos os feitiços e ataques.\n[q2]Equipar: +32 de Poder de Ataque.\n[q2]Uso: Aciona os protocolos de mitigação de radiação do capacete, fazendo você remover imediatamente todos os efeitos de veneno ativos e ganhar imunidade a dano de Natureza por 3 sec. (10 Min Recarga)\nRequer Placas de Veraprata de Baixa Radioatividade , Pelego Grosso Curado (5), Couro Levemente Luminoso (5), Gniodina com Isolamento Térmico"},
