[216606] = {name = "[q2]Runa de Maestria em Duas Mãos", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Grava na veste ou no peitoral a runa de Maestria em Duas Mãos:\n\n\nToda vez que acerta um inimigo com uma arma de duas mãos, você ganha 30% de velocidade de ataque com armas de duas mãos, 10% a mais de Poder de Ataque e 10% a mais de chance de acerto de feitiços por 10 sec. O efeito é perdido se você acertar um inimigo com uma arma de uma mão.\n[q]\"Ensina a você uma nova habilidade de Gravura.\""},
[216607] = {name = "[q4]Oferenda de Luz Sangrenta", additional_info = "Vincula-se ao ser recolhido\nÚnico-equipado: [Blood Moon] (1)\nBerloque\nClasses: Paladino\nRequer Nível 40\n[q2]Uso: Cura instantaneamente 300 pontos de vida do alvo aliado, mas sacrifica 300 dos seus próprios pontos de vida após 2 s. (5 Min Recarga)"},
