[216738] = {name = "[q2]Manual de Redirecionamento", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Ladino\n[q2]Remove todos os seus pontos de combo existentes do alvo e os armazena por até 15 sec. Os pontos de combo armazenados serão transferidos para o próximo inimigo que não seja jogador que você acertar com uma habilidade corpo a corpo ou de longo alcance.\n[q]\"Ensina a Redirecionar.\""},
[216740] = {name = "[q2]Tomo do Intelecto Expandido", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Mago\n[q2]Reduz em 50% o custo de mana de Intelecto Arcano e aumenta em 50% a duração dele.\n[q]\"Ensina Intelecto Expandido.\""},
[216744] = {name = "[q2]Pergaminho da Fortitude Aumentada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Reduz em 50% o custo de mana de Palavra de Poder: Fortitude e aumenta em 50% a duração dela.\n[q]\"Ensina Fortitude Aumentada.\""},
[216745] = {name = "[q2]Pergaminho do Demônio das Sombras", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Sacerdote\n[q2]Cria um demônio das sombras para atacar o alvo. O lançador recebe 5% de mana quando o Demônio das Sombras causa dano. Dura 15 sec.\n[q]\"Ensina Demônio das Sombras.\""},
[216746] = {name = "[q2]Manual do Brado de Comando", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Guerreiro\n[q2]O guerreiro brada, aumentando em 2 o Vigor de todos os integrantes do grupo e do raide em um raio de 30 m. Dura 2 min.\n[q]\"Ensina Brado de Comando.\""},
[216747] = {name = "[q2]Grimório da Colheita de Almas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Toda vez que Drenar Alma causa dano, você tem chance de ganhar um estilhaço de alma adicional. A chance aumenta toda vez que você não ganha um estilhaço de alma.\n[q]\"Ensina Colheita de Almas.\""},
[216748] = {name = "[q2]Grimório de Portal de Evocação", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Bruxo\n[q2]Inicia um ritual que cria um portal de evocação. O portal de evocação pode ser usado por 2 membros do grupo ou do raide para evocar outro membro do grupo ou raide. São necessários o lançador e 2 membros do grupo ou raide para completar o ritual. Para participarem, todos os jogadores devem estar fora de combate, clicar no portal com o botão direito e não se mover até que o ritual esteja completo.\n[q]\"Ensina Portal de Evocação.\""},
[216764] = {name = "[q2]Folheto de Indomabilidade Profunda", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Reduz em 50% o custo de mana de Marca do Indomado e aumenta em 50% a duração dela.\n[q]\"Ensina Indomabilidade Profunda.\""},
[216767] = {name = "[q2]Folheto de Reviver", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Traz um jogador morto de volta à vida com 15% do máximo de pontos de vida e mana dele. Este feitiço não pode ser lançado em combate.\n[q]\"Ensina Reviver.\""},
[216768] = {name = "[q2]Testemunho das Bênçãos Aprimoradas", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Paladino\n[q2]Aumenta em 100% a duração da sua Bênção de Poder, Sabedoria, Salvação, Santuário, Luz e Reis, e reduz em 50% o custo de mana delas.\n[q]\"Ensina Bênçãos Aprimoradas.\""},
[216769] = {name = "[q2]Revelação de Projeção Totêmica", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Xamã\n[q2]Realoca seus totens ativos para o local especificado.\n[q]\"Ensina Projeção Totêmica.\""},
[216770] = {name = "[q2]Tratado do Aspecto da Víbora", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Caçador\n[q2]O Caçador assume o aspecto da víbora, fazendo com que seus ataques automáticos de longo alcance e corpo a corpo regenerem mana, mas reduzindo em 10% o dano total causado. Além disso, você recebe 10% do máximo de pontos de mana a cada 3 s. O mana é recebido com base na velocidade da sua arma. Somente um Aspecto pode estar ativo por vez.\n[q]\"Ensina o Aspecto da Víbora.\""},
[216771] = {name = "[q2]Folheto de Restauração Aprimorada", additional_info = "Vincula-se ao ser recolhido\nÚnico\nClasses: Druida\n[q2]Seus feitiços Rejuvenescer e Recrescimento agora podem ficar ativos em alvos afetados pelo Rejuvenescer ou Recrescimento de outro Druida.\n[q]\"Ensina Restauração Aprimorada.\""},
[216879] = {name = "Pergaminho Trólico Misterioso", additional_info = "Único\nClasses: Mago\n[q2]Uso: Decifra o pergaminho com um Patuá da Compreensão. Vai saber que magia isso contém?\nSaqueado de: Mandingueiro Sanguescalpo\nChance de Saque: 0.01%"},
