[216914] = {name = "[q2]Comenda Manchada de Sangue", additional_info = "Vincula-se ao ser recolhido\nRequer Nível 30\n[q2]Uso: Concede 250 de honra.\n[q]\"No passado, deve ter sido uma recompensa concedida por feitos heroicos em batalha. Embora esteja agora coberta por uma espessa camada de sangue seco, talvez ainda haja leves resquícios da honra e do orgulho do portador, falecido há muito tempo.\""},
